import { TemplateRef } from '@angular/core';

export const ALERT = {
  slideInTime: 50,
  slideOutTime: 100,
};

export interface AlertMessageConfig {
  /**
   * Message or label of the alert. <br>
   * NOTE: Must be used with <code>AlertService.open()</code>
   */
  label?: string;
  /**
   * Message or label of the alert as a template. <br>
   * NOTE: Must be used with <code>AlertService.openFromTemplate()</code>
   */
  labelTemplate?: TemplateRef<any>;
  /**
   * Title for the alert.
   */
  title?: string;
}

export interface AlertDetailsConfig {
  /**
   * Sets the type of alert.
   */
  alertType?: AlertType;
  /**
   * Sets the duration in milliseconds for auto-hiding the alert.
   */
  duration?: number;
  /**
   * The icon to associate with the alert type.
   */
  icon?: string;
  /**
   * Flag that enables slide in animation for the alert.
   */
  slideIn?: boolean;
  /**
   * Flag that enables slide out animation for the alert.
   */
  slideOut?: boolean;
}

export interface AlertActionConfig {
  /**
   * Custom function triggered on click event of action.
   */
  callback?: () => any;
  /**
   * The icon to use for the action.
   */
  icon?: string;
  /**
   * The label for the alert button, or aria-label when used with an icon.
   */
  label?: string;
}

export interface AlertConfig {
  /**
   * Configure the Alert Action(s).
   */
  action?: AlertActionConfig[];
  /**
   * Configure the Alert Details.
   */
  details?: AlertDetailsConfig;
  /**
   * Configure the Alert Message.
   */
  message: AlertMessageConfig;
}

export enum AlertType {
  /**
   * Sets alert to display error styling
   */
  ERROR = 'error',
  /**
   * Sets alert to display informative styling
   */
  INFO = 'info',
  /**
   * Sets alert to display affirmation styling
   */
  SUCCESS = 'success',
  /**
   * Sets alert to display cautionary styling
   */
  WARNING = 'warning',
}

