export enum ColumnType {
  /**
   * Assumes column type is an anchor tag
   */
  LINK = 'link',

  /**
   * Assumes column type is an anchor tag
   */
  EMAIL = 'email',

  /**
   * Assumes column type is a date
   */
  DATE = 'date',

  /**
   * Assumes column type is a button
   */
  BUTTON = 'button',

  /**
   * Assumes column type is a series of buttons and/or anchor tags
   */
  ACTIONS = 'actions',
}

export enum SortDirection {
  /**
   * Ascending sort direction
   */
  ASC = 'asc',
  /**
   * Descending sort direction
