  /**
   * Multi select row action
   */
  MULTI = 'multi',
  /**
   * Expandable row action
   */
  EXPAND = 'expand',
}

export interface ColumnDataItem {
  /**
   * Column header unique id
   */
  id: string;
  /**
   * Column header display text
   */
  value: string;
  /**
   * Column header ColumnType
   */
  type?: ColumnType | RowActionType;
  /**
   * Column header "Group Header" text
   */
  header?: string;
  /**
   * Column header tooltip display text <br>
   * Toolip will display if not an empty string
   */
  tooltipValue?: string;
  /**
   * Column header sort function to overwrite default behavior
   */
  sortFn?: SortFn;
  /**
   * If true, column header will be filtered from display on first render
   */
  isColumnFiltered?: boolean;
  /**
   * If true, column header will be sortable
   */
  isSortable?: boolean;

  /**
   * Set internally by component
   */
  isRowAction?: boolean;
}

export interface CellActionEvent {
  /**
