import { Injectable, ComponentRef } from '@angular/core';
import { AlertComponent } from './alert/alert.component';
import { VdsLibService } from './vds-lib.service';
import {
  AlertConfig,
  AlertType,
} from './alert/alert.constants';

export const ALERT_SERVICE = {
  MESSAGING: {
    MISSING_CONFIG:
      '[VDS NG] Alert missing alert config. Please refer API',
    MISSING_LABEL:
      '[VDS NG] Alert missing message label. Please refer API',
    MISSING_LABEL_TEMPLATE:
      '[VDS NG] Alert missing message label template. Please refer API',
    ACTION_ITEMS_EXCEED:
      '[VDS NG] Alert actions exceed 2 items. UI Pattern not recommended.',
  },
};

@Injectable({
  providedIn: 'root',
})
export class AlertService {
  existingComponent: ComponentRef<AlertComponent>;

  constructor(private vdsLibService: VdsLibService) {}

  private _generateAlert(): ComponentRef<AlertComponent> {
    if (this.existingComponent) {
      this._destroyAlert(this.existingComponent);
      return;
    }
    const alertRef = this.vdsLibService.insertGlobalComponent(
      AlertComponent
    );
    this.existingComponent = alertRef;
    return alertRef;
  }

  private _setProperties(
    alertRef: ComponentRef<AlertComponent>,
    config: AlertConfig
  ) {
    const details = config.details;
    const message = config.message;
    alertRef.instance.message = {
      label: message.label ? message.label : null,
      labelTemplate: message.labelTemplate
        ? message.labelTemplate
        : null,
      title: message.title ? message.title : null,
    };
    alertRef.instance.details = {
      alertType:
        details && details.alertType
          ? details.alertType
          : AlertType.INFO,
      duration:
        details && details.duration
          ? details.duration
          : null,
      icon: details && details.icon ? details.icon : null,
      slideIn: details && details.slideIn,
      slideOut: details && details.slideOut,
    };
    alertRef.instance.action = config.action;
    alertRef.instance.show();
  }

  private _destroyAlert(
    alert: ComponentRef<AlertComponent>
  ) {
    if (!alert.instance.hasCallback()) {
      alert.instance.hide();
    }
  }

  /**
   * Opens an alert of the given configuration using label string. <br>
   * NOTE: Must provide <code>AlertMessageConfig.label</code>
   */
  open(config?: AlertConfig): void {
    if (!config) {
      console.warn(ALERT_SERVICE.MESSAGING.MISSING_CONFIG);
      return;
    }
    if (!config.message || !config.message.label) {
      console.warn(ALERT_SERVICE.MESSAGING.MISSING_LABEL);
      return;
    }
    this._generateAndSetAlert(config);
  }

  /**
   * Opens an alert of the given configuration using label template. <br>
   * NOTE: Must provide <code>AlertMessageConfig.labelTemplate</code>
   */
  openFromTemplate(config?: AlertConfig): void {
    if (!config) {
      console.warn(ALERT_SERVICE.MESSAGING.MISSING_CONFIG);
      return;
    }
    if (!config.message || !config.message.labelTemplate) {
      console.warn(
        ALERT_SERVICE.MESSAGING.MISSING_LABEL_TEMPLATE
      );
      return;
    }
    this._generateAndSetAlert(config);
  }

  private _generateAndSetAlert(config?: AlertConfig): void {
    if (
      this.existingComponent &&
      this.existingComponent.instance
    ) {
      if (this.existingComponent.instance.visible) {
        return;
      }
      if (!this.existingComponent.instance.visible) {
        this.existingComponent = null;
      }
    }
    if (config.action && config.action.length > 2) {
      console.warn(
        ALERT_SERVICE.MESSAGING.ACTION_ITEMS_EXCEED
      );
    }
    const alertRef: ComponentRef<
      AlertComponent
    > = this._generateAlert();
    this._setProperties(alertRef, config);
  }

  /**
   * Closes the alert.
   */
  close() {
    if (this.existingComponent) {
      this._destroyAlert(this.existingComponent);
    }
  }
}

import { ComponentRef, Injectable } from '@angular/core';
import { DialogComponent } from './dialog/dialog.component';
import { VdsLibService } from './vds-lib.service';
import { DialogConfig } from './dialog/dialog.constant';

@Injectable({
  providedIn: 'root',
})
export class DialogService {
  existingComponent: ComponentRef<DialogComponent>;

  constructor(private vdsLibService: VdsLibService) {}

  private _generateDialog(): ComponentRef<DialogComponent> {
    if (this.existingComponent) {
      this._destroyDialog(this.existingComponent);
      return;
    }
    const dialogRef = this.vdsLibService.insertGlobalComponent(
      DialogComponent
    );
    this.existingComponent = dialogRef;
    return dialogRef;
  }

  private _setProperties(
    dialogRef: ComponentRef<DialogComponent>,
    config: DialogConfig
  ) {
    const content = config.content;
    const actions = config.actions;
    if (config && config.id) {
      dialogRef.instance.id = config.id;
    }
    if (config && config.dialogType) {
      dialogRef.instance.messageType = config.dialogType;
    }
    if (config && config.dialogVariant) {
      dialogRef.instance.variant = config.dialogVariant;
    }
    if (config && content.title) {
      dialogRef.instance.title = content.title;
    }
    if (config && content.body) {
      dialogRef.instance.dialogBodyTemplate = content.body;
    }
    if (config && config.actions) {
      dialogRef.instance.action = actions;
    }
    dialogRef.instance.show();
  }

  private _destroyDialog(
    dialog: ComponentRef<DialogComponent>
  ) {
    dialog.instance.hide();
  }

  /**
   *  Opens a dialog.
   */
  open(config?: DialogConfig): void {
    if (!config) {
      console.warn(
        '[VDS NG] Dialog missing dialog config. Please refer API'
      );
      return;
    }
    if (!config.content) {
      console.warn(
        '[VDS NG] Dialog missing dialog content. Please refer API'
      );
      return;
    }
    if (config.actions && config.actions.length > 2) {
      console.warn(
        '[VDS NG] Dialog actions exceed 2 items. UI Pattern not recommended.'
      );
    }
    if (
      this.existingComponent &&
      this.existingComponent.instance
    ) {
      if (this.existingComponent.instance.isOpen) {
        return;
      }
      if (!this.existingComponent.instance.isOpen) {
        this.existingComponent = null;
      }
    }
    const dialogRef: ComponentRef<
      DialogComponent
    > = this._generateDialog();
    this._setProperties(dialogRef, config);
  }
}

import { Injectable, OnDestroy } from '@angular/core';
import { Subject } from 'rxjs';

@Injectable({
  providedIn: 'root',
})
export class RowSelectionService implements OnDestroy {
  _rowData = [];
  _stateChange = new Subject();
  selection = [];
  isHeaderSelected = false;

  ngOnDestroy() {
    this._stateChange.complete();
  }

  updateState(rowData, isSingle) {
    if (Array.isArray(rowData)) {
      this._rowData = rowData.slice();

      this.selection = this._rowData.filter(
        (row) => row.__rowChecked__
      );

      if (isSingle) {
        // if we find more than 1 row selected, we return the first row selection found
        if (this.selection.length > 0) {
          this.selection = [this.selection[0]];
        }
      } else {
        this.isHeaderSelected =
          this._rowData.length === this.selection.length;
      }
    }
  }

  handleHeaderSelect = () => {
    this.isHeaderSelected = !this.isHeaderSelected;
    this.selection = this.isHeaderSelected
      ? this._rowData.slice()
      : [];
    this._emitStateChange(null);
  };

  handleRowMultiSelect = (row) => {
    const selection = this.selection.slice();
    const rowIndex = selection.indexOf(row);

    if (rowIndex === -1) {
      selection.push(row);
    } else {
      selection.splice(rowIndex, 1);
    }

    this.isHeaderSelected =
      selection.length === this._rowData.length;
    this.selection = selection;
    this._emitStateChange(row);
  };

  handleRowSingleSelect = (row) => {
    const rowIndex = this.selection.indexOf(row);
    const selection = rowIndex === -1 ? [row] : [];

    this.isHeaderSelected = false;
    this.selection = selection;
    this._emitStateChange(row);
  };

  handleExpandLazySelect = (row) => {
    const rowIndex = this.selection.indexOf(row);
    const checked = rowIndex === -1;

    // we only record when we un-select for the lazy case
    if (!checked) {
      const selection = this.selection.slice();
      selection.splice(rowIndex, 1);
      this.isHeaderSelected = false;
      this.selection = selection;
    }

    this._emitStateChange(row, checked);
  };

  handleHeaderLazySelect = () => {
    const isHeaderSelected = !this.isHeaderSelected;

    // we only record when we un-select for the lazy case
    if (!isHeaderSelected) {
      this.selection = [];
    }

    this._emitStateChange(null, isHeaderSelected);
  };

  _emitStateChange(
    row,
    checked = this.selection.indexOf(row) !== -1
  ) {
    this._stateChange.next({
      row,
      checked,
      selectionArray: this.selection,
      isHeaderSelected: this.isHeaderSelected,
    });
  }
}

