import {
  Directive,
  Output,
  EventEmitter,
  ElementRef,
  HostListener,
  OnInit,
  OnDestroy,
  Input,
} from '@angular/core';
import { Subject } from 'rxjs';
import { debounceTime } from 'rxjs/operators';
import { coerceBooleanProperty } from '@angular/cdk/coercion';
@Directive({
  selector: '[vdsSidenavScroll]',
})
export class SidenavScrollDirective
  implements OnInit, OnDestroy {
  @Output() setScroll = new EventEmitter();

  _turnOff;
  get turnOff(): boolean {
    return this._turnOff;
  }
  @Input()
  set turnOff(off: boolean) {
    this._turnOff = coerceBooleanProperty(off);
  }

  debouncer = new Subject<number>();
  debouncerObservable$ = this.debouncer.asObservable();

  constructor(private el: ElementRef) {}

  ngOnDestroy() {
    this.debouncer.complete();
  }

  ngOnInit() {
    this.debouncerObservable$
      .pipe(debounceTime(200))
      .subscribe((data) => {
        this.setScroll.emit(data);
      });
  }

  @HostListener('scroll')
  scroll() {
    if (!this.turnOff) {
      this.debouncer.next(this.el.nativeElement.scrollTop);
    }
  }

  reset(scroll) {
    if (scroll >= 0) {
      setTimeout(() => {
        this.el.nativeElement.scrollTop = scroll;
      }, 0);
    }
  }
}

import {
  Directive,
  EventEmitter,
  Input,
  OnChanges,
  OnDestroy,
  Output,
} from '@angular/core';
import {
  ColumnType,
  Sortable,
  SortDirection,
  SortFn,
} from '../datatable.constants';
import { Subject } from 'rxjs';

const isSortDirectionValid = (value: any) => {
  return (
    value !== null &&
    value !== undefined &&
    [SortDirection.ASC, SortDirection.DESC].includes(value)
  );
};

@Directive({
  selector: '[vdsSortHeader]',
})
export class SortHeaderDirective
  implements OnChanges, OnDestroy {
  @Input()
  get sortActiveId() {
    return this._sortActiveId;
  }
  set sortActiveId(value: string | number) {
    this._sortActiveId = value;
  }
  _sortActiveId: string | number = null;

  @Input()
  get sortDirection() {
    return this._sortDirection;
  }
  set sortDirection(value: SortDirection) {
    if (isSortDirectionValid(value)) {
      this._sortDirection = value;
    }
  }
  _sortDirection: SortDirection = SortDirection.ASC;

  @Input()
  get sortStart() {
    return this._sortStart;
  }
  set sortStart(value: SortDirection) {
    if (isSortDirectionValid(value)) {
      this._sortStart = value;
    }
  }
  _sortStart: SortDirection = SortDirection.ASC;

  @Output()
  sortEvent: EventEmitter<any> = new EventEmitter<any>();

  _stateChange = new Subject();
  stateChange$ = this._stateChange.asObservable();
  sortColumnType: ColumnType = null;
  sortFn: SortFn;

  ngOnChanges() {
    this._emitStateChange();
  }

  ngOnDestroy() {
    this._stateChange.complete();
  }

  sort(sortable: Sortable): void {
    this.sortDirection =
      this.sortActiveId === sortable.id
        ? this.sortDirection === SortDirection.ASC
          ? SortDirection.DESC
          : SortDirection.ASC
        : this.sortStart;
    this.sortActiveId = sortable.id;
    this.sortColumnType = sortable.type;
    this.sortFn = sortable.sortFn;

    this._emitStateChange();

    this.sortEvent.emit(this._getSortState());
  }

  _emitStateChange() {
    this._stateChange.next(this._getSortState());
  }

  _getSortState() {
    return {
      id: this.sortActiveId,
      direction: this.sortDirection,
      sortFn: this.sortFn,
      type: this.sortColumnType,
    };
  }
}

import {
  Input,
  Directive,
  ComponentRef,
  ElementRef,
  OnInit,
  HostListener,
  OnChanges,
  OnDestroy,
} from '@angular/core';

import { TooltipComponent } from './tooltip.component';
import { VdsLibService } from '../vds-lib.service';

export interface TooltipOptions {
  active: boolean;
  content: string;
  position: string;
  visible: boolean;
}

const defaultTooltipOptions: TooltipOptions = {
  active: true,
  content: '',
  position: 'auto',
  visible: false,
};

@Directive({
  selector: '[vdsTooltip]',
})
export class TooltipDirective
  implements OnInit, OnChanges, OnDestroy {
  /**
   * Use this directive on a component/HTML element to add TooltipComponent.
   * <br>
   * <code>
   *   // type: TooltipOptions  <br>
   *   {  <br>
   *     content: 'string of tooltip content',  <br>
   *     position: string  ['top', 'right', 'bottom', 'left'],  <br>
   *   }
   * </code>
   * <br>
   *   OR
   * <br>
   * <code>
   *   // type: string  <br>
   *   "string of tooltip content"
   * </code>
   */
  @Input('vdsTooltip')
  public tooltipOptions: any;

  private tooltip: any;
  private hideTimer: number;

  constructor(
    public elementRef: ElementRef,
    private vdsLibService: VdsLibService
  ) {}

  ngOnInit() {
    if (!this.tooltipOptions) {
      this.tooltipOptions = defaultTooltipOptions;
      return;
    }
    if (typeof this.tooltipOptions === 'string') {
      const content = this.tooltipOptions;
      this.tooltipOptions = {
        position: 'auto',
        active: true,
        visible: false,
        content,
      };
    }
  }

  @HostListener('mouseenter')
  onMouseEnter() {
    this.showTooltip();
  }

  @HostListener('mouseleave')
  onMouseLeave() {
    this.hideTooltip();
  }

  @HostListener('focus')
  onFocus() {
    this.showTooltip();
  }

  @HostListener('focusout')
  onfocusout() {
    this.hideTooltip();
  }

  ngOnChanges() {
    if (
      this.tooltipOptions.active === false &&
      this.tooltip
    ) {
      this.hideTooltip();
    } else {
      return;
    }
  }

  ngOnDestroy(): void {
    if (this.tooltip) {
      this.tooltip.destroy();
    }
    delete this.tooltip;
    if (window) {
      if (this.hideTimer) {
        window.clearTimeout(this.hideTimer);
      }
    }
  }

  showTooltip() {
    if (this.tooltip) {
      return;
    }
    if (this.tooltipOptions.content.length > 0) {
      this.tooltipOptions.visible = true;
      this.tooltip = this.vdsLibService.insertGlobalComponent(
        TooltipComponent
      );
      this.tooltip.instance.parentEl = this.elementRef;
      this.tooltip.instance.content = this.tooltipOptions.content;
      this.tooltip.instance.tooltipOptions = this.tooltipOptions;
    }
  }

  hideTooltip() {
    if (window) {
      if (this.hideTimer) {
        window.clearTimeout(this.hideTimer);
      }
      this.hideTimer = window.setTimeout(() => {
        this.tooltipOptions.visible = false;
        if (this.tooltip) {
          this.tooltip.destroy();
        }
        delete this.tooltip;
      }, 1);
    }
  }
}

