import {
  Component,
  OnInit,
  ContentChildren,
  AfterViewInit,
  AfterContentInit,
} from '@angular/core';
import { BreadcrumbComponent } from '../breadcrumb/breadcrumb.component';
import { BREADCRUMBS } from '../breadcrumb/breadcrumb.constant';
import { Router } from '@angular/router';

@Component({
  selector: 'vds-breadcrumbs',
  templateUrl: './breadcrumbs.component.html',
})
export class BreadcrumbsComponent
  implements OnInit, AfterViewInit, AfterContentInit {
  @ContentChildren(BreadcrumbComponent) crumbs;

  currentUrl: string;

  constructor(private route: Router) {}

  ngOnInit() {}

  ngAfterContentInit() {
    this.crumbs.last.isLast = true;
    this.currentUrl = this.route.url;
    for (const crumb of this.crumbs._results) {
      if (crumb.path === this.currentUrl) {
        crumb.element[0].classList = `${
          BREADCRUMBS.CLASS.DEFAULT
        } ${BREADCRUMBS.CLASS.ACTIVE}`;
        crumb.element[0].setAttribute(
          BREADCRUMBS.ARIA.CURRENT_ATTRIBUTE,
          BREADCRUMBS.ARIA.CURRENT_VALUE
        );
      }
    }
  }

  ngAfterViewInit() {
    this.crumbs.forEach((crumb) => {
      crumb.selectEvent.subscribe((id) => {
        this.setActiveCrumb(id);
      });
    });
  }

  setActiveCrumb(id: string) {
    const crumbRefs = this.crumbs._results;
    for (const crumb of crumbRefs) {
      crumb.element[0].classList =
        BREADCRUMBS.CLASS.DEFAULT;
      crumb.element[0].removeAttribute(
        BREADCRUMBS.ARIA.CURRENT_ATTRIBUTE
      );
      if (crumb.id === id) {
        crumb.element[0].classList = `${
          BREADCRUMBS.CLASS.DEFAULT
        } ${BREADCRUMBS.CLASS.ACTIVE}`;
        crumb.element[0].setAttribute(
          BREADCRUMBS.ARIA.CURRENT_ATTRIBUTE,
          BREADCRUMBS.ARIA.CURRENT_VALUE
        );
      }
    }
  }
}

