  }
  set label(value: string) {
    this._label = value;
  }
  _label: string;

  @ContentChildren(SelectComponent) selects: QueryList<
    SelectComponent
  >;

  delimiter = EXPIRATION.DEFAULT.DELIMITER;
  id: string;
  _selects: Array<SelectComponent>;

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.label = this.label
      ? this.label
      : EXPIRATION.DEFAULT.LABEL;
    this.invalidText = this.invalidText
      ? this.invalidText
      : EXPIRATION.DEFAULT.GROUP_ERROR;
    this.id = this.vdsLibService.getUUID();
  }

  ngAfterContentInit() {
    this._selects = this.selects.toArray();
  }

  ngOnChanges() {
    if (this._selects) {
      const selectOne = this._selects[0];
      const selectTwo = this._selects[1];
      switch (this.invalid) {
        case true:
          selectOne.invalid = true;
          selectOne.groupError = true;
          selectTwo.invalid = true;
          selectTwo.groupError = true;
          break;
        case false:
        default:
          selectOne.invalid = false;
          selectTwo.invalid = false;
          selectOne.groupError = false;
          selectTwo.groupError = false;
          break;
      }
