import {
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  Component,
  EventEmitter,
  Input,
  OnInit,
  Output,
} from '@angular/core';
import { VdsLibService } from '../vds-lib.service';
import {
  CHECKBOX,
  CheckboxChange,
} from './checkbox.constant';
import {
  AbstractValueAccessor,
  MakeProvider,
} from '../abstract-value-accessor';

@Component({
  selector: 'vds-checkbox',
  templateUrl: './checkbox.component.html',
  providers: [MakeProvider(CheckboxComponent)],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class CheckboxComponent extends AbstractValueAccessor
  implements OnInit {
  /**
   * Checks the checkbox statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() checked: boolean;
  /**
   * Accessibility description label.
   */
  @Input() describedBy: string;
  /**
   * Disable checkbox statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() disabled: boolean;
  /**
   * The id of the input element.
   */
  @Input() id: string;
  /**
   * Set indeterminate statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() indeterminate: boolean;
  /**
   * Set invalid statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() invalid: boolean;
  /**
   * The user display label of the checkbox.
   */
  @Input() label: string;
  /**
   * The name of the input element.
   */
  @Input() name: string;
  /**
   * The value of the input element.
   */
  @Input() value: string;
  /**
   * Used to denote read only checkboxes
   */
  @Input() readOnly: boolean;
  /**
   * Emits change event.
   */
  @Output() change: EventEmitter<
    CheckboxChange
  > = new EventEmitter();

  public checkboxID: string;
  public checkboxName: string;
  public checkboxValue: string;
  public focused = false;

  constructor(
    private cdRef: ChangeDetectorRef,
    private vdsLibService: VdsLibService
  ) {
    super();
  }

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(CHECKBOX.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + CHECKBOX.SUFFIX.NAME;
    this.checkboxID = `${this.id}${CHECKBOX.SUFFIX.NATIVE}`;
    this.checkboxName = `${this.name}${
      CHECKBOX.SUFFIX.NATIVE
    }`;
    this.checked = this.vdsLibService.triageDisabledValue(
      this.checked
    );
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
    this.readOnly = this.vdsLibService.triageDisabledValue(
      this.readOnly
    );
    this.indeterminate = this.vdsLibService.triageDisabledValue(
      this.indeterminate
    );
    this.invalid = this.vdsLibService.triageDisabledValue(
      this.invalid
    );
    this.checkboxValue = this.value;
    this.writeValue(this.checked);
  }

  writeValue(value: any) {
    super.writeValue(value);
    this.checked = value;
    this.change.emit({
      checked: this.checked,
      source: this,
    });
    this.cdRef.detectChanges();
  }

  checkAndWrite(): void {
    if (!this.disabled && !this.readOnly) {
      this.checked = !this.checked;
    }
    this.writeValue(this.checked);
  }

  click(): void {
    this.checkAndWrite();
    event.stopPropagation();
  }

  onKeyDown(event: KeyboardEvent): void {
    this.checkAndWrite();
    event.stopPropagation();
    event.preventDefault();
  }

  onFocus(): void {
    this.focused = true;
  }

  onBlur(): void {
    this.focused = false;
  }
}

