import {
  AfterContentInit,
  Component,
  ContentChild,
  OnInit,
  Input,
  EventEmitter,
  Output,
  ChangeDetectorRef,
} from '@angular/core';
import { ButtonComponent } from '../button/button.component';
import { CHIP } from './chip.constants';
import { VdsLibService } from '../vds-lib.service';
import { CheckboxComponent } from '../checkbox/checkbox.component';
import { TextComponent } from '../text/text.component';
import { AbstractValueAccessor } from '../abstract-value-accessor';
import { coerceBooleanProperty } from '@angular/cdk/coercion';

@Component({
  selector: 'vds-chip',
  templateUrl: './chip.component.html',
})
export class ChipComponent extends AbstractValueAccessor
  implements OnInit, AfterContentInit {
  @ContentChild(ButtonComponent)
  button: ButtonComponent;
  @ContentChild(CheckboxComponent)
  checkbox: CheckboxComponent;
  @ContentChild(TextComponent)
  text: TextComponent;

  /**
   * Disable chip statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input()
  get disabled(): boolean {
    return this._disabled;
  }
  set disabled(value) {
    this._disabled = coerceBooleanProperty(value);
  }
  _disabled: boolean;

  /**
   * The id of the element.
   */
  @Input()
  get id(): string {
    return this._id;
  }
  set id(value) {
    this._id = value;
  }
  _id: string;

  /**
   * Set chip read only statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input()
  get readOnly(): boolean {
    return this._readOnly;
  }
  set readOnly(value) {
    this._readOnly = coerceBooleanProperty(value);
  }
  _readOnly: boolean;

  /**
   * Emits changed value.
   */
  @Output() change: EventEmitter<any> = new EventEmitter();

  public chipID: string;
  public focused: boolean;
  public isSelected: boolean;

  constructor(
    private cdRef: ChangeDetectorRef,
    private vdsLibService: VdsLibService
  ) {
    super();
  }

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(CHIP.PREFIX.ID);
    this.chipID = `${this.id}${CHIP.SUFFIX.NATIVE}`;
  }

  ngAfterContentInit() {
    if (this.checkbox) {
      if (this.disabled) {
        this.checkbox.disabled = true;
        this.checkbox.describedBy =
          CHIP.DEFAULT.DESCRIPTION.DISABLED;
      }
      if (this.readOnly) {
        this.checkbox.readOnly = true;
        this.checkbox.describedBy =
          CHIP.DEFAULT.DESCRIPTION.READONLY;
      }
      this.isSelected = this.checkbox.checked;
      this.checkbox.change.subscribe((change: any) => {
        this.isSelected = change.source.checked;
        this.change.emit({
          checked: change.checked,
          source: this,
        });
        this.cdRef.detectChanges();
      });
    }

    if (this.disabled && this.button) {
      this.button.disabled = true;
    }
    if (this.readOnly && this.button) {
      this.button.describedBy =
        CHIP.DEFAULT.DESCRIPTION.READONLY;
    }
  }
}

