import {
  AfterContentInit,
  AfterViewInit,
  ChangeDetectionStrategy,
  Component,
  ContentChild,
  ElementRef,
  EventEmitter,
  Input,
  OnDestroy,
  OnInit,
  Output,
  TemplateRef,
  ViewChild,
  ViewEncapsulation,
} from '@angular/core';
import {
  BehaviorSubject,
  combineLatest,
  of,
  Subject,
} from 'rxjs';
import {
  DATATABLE,
  CellActionEvent,
  RowActionEvent,
  RowActionType,
  SortDirection,
  SortEvent,
  ColumnDataItem,
  GroupHeaderItem,
} from './datatable.constants';
import { SortHeaderDirective } from './sort-header/sort-header.directive';
import { PaginationComponent } from '../pagination/pagination.component';
import { PageEvent } from '../pagination/pagination.constant';
import {
  coerceBooleanProperty,
  coerceNumberProperty,
} from '@angular/cdk/coercion';
import { TemplateContainerComponent } from '../custom-template/template-container.component';
import { RowSelectionService } from './row-selection.service';
import { CellFactoryComponent } from './cell-factory/cell-factory.component';

const columnPrepMapFn = (column: any) => {
  const isColumnFiltered = column.hasOwnProperty(
    'isColumnFiltered'
  )
    ? !!column.isColumnFiltered
    : false;
  const isSortable = column.hasOwnProperty('isSortable')
    ? !!column.isSortable
    : false;

  if (!column.hasOwnProperty('id')) {
    throw new Error(
      'Every column object must have an `id` property containing a unique string'
    );
  }

  let sortFn = null;
  if (typeof column.sortFn === 'function') {
    let retValue = column.sortFn(1, 2);
    if (retValue !== undefined && retValue !== null) {
      retValue = Number(retValue);
      if (
        retValue === 0 ||
        retValue === 1 ||
        retValue === -1
      ) {
        sortFn = column.sortFn;
      }
    }
  }

  return {
    id: column.id.toString(),
    value:
      column.value !== undefined && column.value !== null
        ? column.value
        : '',
    type: (column.type || '').toString().trim(),
    header:
      column.header !== undefined && column.header !== null
        ? column.header
        : '',
    tooltipValue:
      column.tooltipValue !== undefined &&
      column.tooltipValue !== null
        ? column.tooltipValue
        : '',
    sortFn,
    isColumnFiltered,
    isSortable,
  };
};

@Component({
  selector: 'vds-datatable',
  templateUrl: './datatable.component.html',
  styleUrls: ['./datatable.component.scss'],
  changeDetection: ChangeDetectionStrategy.OnPush,
  encapsulation: ViewEncapsulation.None,
  providers: [RowSelectionService],
})
export class DatatableComponent
  implements
    OnInit,
    AfterContentInit,
    AfterViewInit,
    OnDestroy {
  /**
   * Row data array
   * Default: <code>[]</code>
   */
  @Input()
  get rowData(): any[] {
    return this._rowData;
  }
  set rowData(value: any[]) {
    if (Array.isArray(value)) {
      this._rowData = value.slice();

      if (this.enableLocalSortPagination) {
        this.sortTableDirective._emitStateChange();
      } else {
        this._rowDataSource.next(this._rowData);
      }

      this._updateRowService();
    }
  }
  _rowData = [];

  /**
   * Column data array
   * Default: <code>[]</code>
   */
  @Input()
  get columnData(): ColumnDataItem[] {
    return this._columnData;
  }
  set columnData(value: ColumnDataItem[]) {
    if (Array.isArray(value)) {
      this._columnData = value.slice();
      this._columnDataSource.next(
        this._columnData.map(columnPrepMapFn)
      );
      this._groupHeaderDataSource.next(
        this.__getGroupHeaderDataSource()
      );

      this._updateColumnDataSource();
    }
  }
  _columnData = [];

  /**
   * Whether component is in loading state
   * Default: <code>false</code>
   */
  @Input()
  get loading(): boolean {
    return this._loading;
  }
  set loading(value) {
    this._loading = coerceBooleanProperty(value);
  }
  _loading = false;

  /**
   * Row button action type; select from 'multi', 'single', 'expand', or 'none'
   * Default: <code>'none'</code>
   */
  @Input()
  get rowActionType(): RowActionType {
    return this._rowActionType;
  }
  set rowActionType(value: RowActionType) {
    this._rowActionType = value;

    this._updateRowService();

    this._updateColumnDataSource();
  }
  _rowActionType: RowActionType = RowActionType.NONE;

  /**
   * Number of expanded rows to display when in 'per column' view
   * Default: <code>5</code>
   */
  @Input()
  get maxNumberOfExpandedRows(): number {
    return this._maxNumberOfExpandedRows;
  }
  set maxNumberOfExpandedRows(value) {
    this._maxNumberOfExpandedRows = Math.max(
      coerceNumberProperty(
        value,
        DATATABLE.DEFAULTS.MAX_NUMBER_EXPANDED_ROWS
      ),
      1
    );
  }
  _maxNumberOfExpandedRows =
    DATATABLE.DEFAULTS.MAX_NUMBER_EXPANDED_ROWS;

  /**
   * Sort header id to set as active when component first renders
   * Default: <code>null</code>
   */
  @Input() sortActiveId = null;

  /**
   * Sort direction for active header when component first renders
   * Default: <code>'asc'</code>
   */
  @Input() sortDirection: SortDirection = SortDirection.ASC;

  /**
   * Sort start direction for when sort header is selected
   * Default: <code>'asc'</code>
   */
  @Input() sortStart: SortDirection = SortDirection.ASC;

  /**
   * Whether column filtering should be enabled
   * Default: <code>false</code>
   */
  @Input()
  get enableColumnFilter(): boolean {
    return this._enableColumnFilter;
  }
  set enableColumnFilter(value) {
    this._enableColumnFilter = coerceBooleanProperty(value);
  }
  _enableColumnFilter = false;

  /**
   * If true component will handle sorting and pagination synchronously within the component
   * Default: <code>false</code>
   */
  @Input()
  get enableLocalSortPagination(): boolean {
    return this._enableLocalSortPagination;
  }
  set enableLocalSortPagination(value) {
    this._enableLocalSortPagination = coerceBooleanProperty(
      value
    );
  }
  _enableLocalSortPagination = false;

  /**
   * If true component will load expanded row content synchronously
   * Default: <code>false</code>
   */
  @Input()
  get enableLocalExpandedRow(): boolean {
    return this._enableLocalExpandedRow;
  }
  set enableLocalExpandedRow(value) {
    this._enableLocalExpandedRow = coerceBooleanProperty(
      value
    );
  }
  _enableLocalExpandedRow = false;

  /**
   * Whether table should enable a sticky header
   * Default: <code>false</code>
   */
  @Input()
  get enableStickyHeader(): boolean {
    return this._enableStickyHeader;
  }
  set enableStickyHeader(value) {
    this._enableStickyHeader = coerceBooleanProperty(value);
  }
  _enableStickyHeader = false;

  /**
   * Whether table should display in compact view
   * Default: <code>false</code>
   */
  @Input()
  get enableCompactView(): boolean {
    return this._enableCompactView;
  }
  set enableCompactView(value) {
    this._enableCompactView = coerceBooleanProperty(value);
  }
  _enableCompactView = false;

  /**
   * Whether table divider lines should display
   * Default: <code>false</code>
   */
  @Input()
  get enableDividerLines(): boolean {
    return this._enableDividerLines;
  }
  set enableDividerLines(value) {
    this._enableDividerLines = coerceBooleanProperty(value);
  }
  _enableDividerLines = false;

  /**
   * Message to display when rowData is an empty array
   * Default: <code>'No records found'</code>
   */
  @Input() noDataMessage = DATATABLE.DEFAULTS.NO_DATA_MSG;

  /**
   * Message to display for the default loader
   * Default: <code>'Loading...'</code>
   */
  @Input() loadingMessage = DATATABLE.DEFAULTS.LOADING_MSG;

  /**
   * Emits when a cell button is selected
   */
  @Output() cellActionEvent = new EventEmitter<
    CellActionEvent
  >();

  /**
   * Emits when a sort header is selected
   */
  @Output() sortEvent = new EventEmitter<SortEvent>();

  /**
   * Emits when a column filter checkbox is selected
   */
  @Output() filterEvent = new EventEmitter<string[]>();

  /**
   * Emits when a row action button is selected
   */
  @Output() rowActionEvent = new EventEmitter<
    RowActionEvent
  >();

  @ViewChild(SortHeaderDirective)
  sortTableDirective: SortHeaderDirective;

  @ViewChild('factory') factory: CellFactoryComponent;

  @ContentChild(PaginationComponent)
  paginator: PaginationComponent;

  @ContentChild(TemplateContainerComponent)
  templateContainer: TemplateContainerComponent;

  _displayHeader = false;
  _rowDetailTemplateId = DATATABLE.DEFAULTS.ROW_DETAILS;
  _templateMap: Map<string, TemplateRef<any>> = new Map();
  _tableDataSource = new BehaviorSubject<any[]>([]);
  _rowDataSource = new BehaviorSubject<any[]>([]);
  _columnDataSource = new BehaviorSubject<ColumnDataItem[]>(
    []
  );
  _groupHeaderDataSource = new BehaviorSubject<
    GroupHeaderItem[]
  >([]);
  _groupHeaderTitleDataSource = new BehaviorSubject<
    string[]
  >([]);
  _expandStateChange = new Subject();

  tableStateChange$ = this._tableDataSource.asObservable();
  columnStateChange$ = this._columnDataSource.asObservable();
  selectionStateChange$ = this.rowSelectionService._stateChange.asObservable();
  expandStateChange$ = this._expandStateChange.asObservable();
  sortStateChange$ = null;
  paginatorStateChange$ = null;

  constructor(
    public rowSelectionService: RowSelectionService,
    private element: ElementRef
  ) {}

  ngOnInit() {
    this._groupHeaderDataSource.next(
      this.__getGroupHeaderDataSource()
    );
    this.sortStateChange$ = this.sortTableDirective.stateChange$;
    this.paginatorStateChange$ = this.paginator
      ? this.paginator.stateChange$
      : of(null);

    // listen for row selection
    this.selectionStateChange$.subscribe((value: any) => {
      if (this.rowActionType === RowActionType.EXPAND) {
        this._expandStateChange.next();
      }

      this.rowActionEvent.emit(value);
    });

    const collator = new Intl.Collator(undefined, {
      sensitivity: 'base',
      numeric: true,
    });

    // listen for sort button selection
    this.sortStateChange$.subscribe((state) => {
      if (this.enableLocalSortPagination) {
        const { id, direction, sortFn } = state;
        let { type } = state;

        if (type === null || type === undefined) {
          const columnObj = this._columnDataSource
            .getValue()
            .find((element) => element.id === id);
          if (columnObj !== undefined) {
            type = columnObj.type;
          }
        }

        this._rowDataSource.next(
          this.rowData.slice().sort((a, b) => {
            const aSortValue =
              (a[id] && a[id].value) || a[id];
            const bSortValue =
              (b[id] && b[id].value) || b[id];
            let sortLeft = (
              (direction === SortDirection.ASC
                ? aSortValue
                : bSortValue) || ''
            ).toString();
            let sortRight = (
              (direction === SortDirection.ASC
                ? bSortValue
                : aSortValue) || ''
            ).toString();

            if (type === 'date') {
              sortLeft = new Date(sortLeft)
                .getTime()
                .toString();
              sortRight = new Date(sortRight)
                .getTime()
                .toString();
            }

            if (sortFn) {
              return sortFn(sortLeft, sortRight, {
                direction,
                id,
                type,
              });
            }

            return collator.compare(sortLeft, sortRight);
          })
        );
      }
    });

    // listen for pagination changes along w/ changes to the row data source
    combineLatest([
      this.paginatorStateChange$,
      this._rowDataSource,
    ]).subscribe(([page, dataset]: [PageEvent, any[]]) => {
      if (
        this.enableLocalSortPagination &&
        this.paginator
      ) {
        const i = page.pageIndex * page.pageSize;
        const pageDataset = dataset.slice(
          i,
          i + page.pageSize
        );
        this._tableDataSource.next(pageDataset);
      } else {
        this._tableDataSource.next(dataset);
      }
    });
  }

  ngAfterContentInit() {
    if (
      this.templateContainer &&
      this.templateContainer.templateChildren
    ) {
      this.templateContainer.templateChildren
        .toArray()
        .forEach((child) => {
          if (!this._templateMap.get(child.id)) {
            this._templateMap.set(child.id, child.template);
          }
        });
    }
  }

  ngAfterViewInit() {
    this.element.nativeElement.querySelector(
      'thead'
    ).className = 'vds-thead';
    this.element.nativeElement.querySelector(
      'tbody'
    ).className = 'vds-tbody';
  }

  ngOnDestroy() {
    this._rowDataSource.complete();
    this._columnDataSource.complete();
    this._tableDataSource.complete();
    this._expandStateChange.complete();
    this._groupHeaderDataSource.complete();
    this._groupHeaderTitleDataSource.complete();
  }

  handleCellActionSelect = (cell: any, row: any): void => {
    this.cellActionEvent.emit({ cell, row });
  };

  handleFilterColumn(columnIndex) {
    if (columnIndex !== null) {
      const columnDataSource = this._columnDataSource
        .getValue()
        .slice();
      columnDataSource[columnIndex] = {
        ...columnDataSource[columnIndex],
        isColumnFiltered: !columnDataSource[columnIndex]
          .isColumnFiltered,
      };

      this._columnDataSource.next(columnDataSource);
      this._groupHeaderDataSource.next(
        this.__getGroupHeaderDataSource()
      );
      this.filterEvent.emit(
        this._getDisplayedColumns(false)
      );
    }
  }

  _trackCell(id, cell) {
    return cell;
  }

  _multiRowDetails(j, index, row) {
    return (
      Array.isArray(row[this._rowDetailTemplateId]) &&
      (row[this._rowDetailTemplateId][j] !== undefined &&
        row[this._rowDetailTemplateId][j] !== null)
    );
  }

  _getDisplayedColumns(includeRowAction = true) {
    if (Array.isArray(this._columnDataSource.getValue())) {
      return this._columnDataSource
        .getValue()
        .filter((data) =>
          !includeRowAction ? !data.isRowAction : true
        )
        .filter((data) => !data.isColumnFiltered)
        .map((data) => data.id);
    }

    return [];
  }

  _getMaxNumOfExpandedRowArray() {
    return Array.from(
      { length: this.maxNumberOfExpandedRows },
      (v, i) => i
    );
  }

  _getCellTemplate(column, isExpanded = false) {
    if (
      isExpanded &&
      (column.type === RowActionType.SINGLE ||
        column.type === RowActionType.MULTI ||
        column.type === RowActionType.EXPAND)
    ) {
      return (
        this._templateMap.get(column.id) ||
        this.factory.default
      );
    }

    return (
      this._templateMap.get(column.id) ||
      this.factory[column.type] ||
      this.factory.default
    );
  }

  _getNumberOfOpenExpandedRows() {
    let total = 0;

    if (this.rowActionType === RowActionType.EXPAND) {
      this.rowSelectionService.selection.forEach((row) => {
        if (Array.isArray(row.__rowDetails__)) {
          total += Math.min(
            row.__rowDetails__.length,
            this.maxNumberOfExpandedRows
          );
        } else if (row.__rowDetails__ !== null) {
          total += 1;
        }
      });
    }

    return total;
  }

  __getGroupHeaderDataSource(): GroupHeaderItem[] {
    let prevGroup;
    let prevIndex;

    const headerData = this._columnDataSource
      .getValue()
      .reduce((accum, curValue, i) => {
        if (!curValue.isColumnFiltered) {
          if (
            curValue.hasOwnProperty('header') &&
            curValue.header.length
          ) {
            if (
              !accum[i] &&
              prevGroup !== curValue.header
            ) {
              accum[i] = {
                value: curValue.header,
                span: 1,
              };

              prevGroup = curValue.header;
              prevIndex = i;
            } else if (prevGroup === curValue.header) {
              accum[prevIndex].span += 1;
            }
          } else {
            accum[i] = {
              value: `___blank_${i}`,
              span: 1,
              ignore: true,
            };
          }
        } else {
          accum[i] = undefined;
        }
        return accum;
      }, {});

    const retArray = Object.values(headerData).filter(
      Boolean
    ) as GroupHeaderItem[];
    this._groupHeaderTitleDataSource.next(
      retArray.map(
        (header: GroupHeaderItem) => header.value
      )
    );
    this._displayHeader =
      retArray.filter(
        (val: GroupHeaderItem) =>
          !val.value.includes(`__blank_`)
      ).length > 0;

    return retArray;
  }

  _createTemplateActionsArray(actions) {
    if (actions === undefined || actions === null) {
      return [];
    }

    if (Array.isArray(actions)) {
      return [...actions];
    }

    return [actions];
  }

  _isRowSelected(row) {
    return (
      this.rowSelectionService.selection.indexOf(row) !== -1
    );
  }

  _isColumnTypeAction(type, isHeader = false) {
    if (isHeader) {
      return (
        type === RowActionType.EXPAND ||
        type === RowActionType.MULTI
      );
    }

    return (
      type === RowActionType.EXPAND ||
      type === RowActionType.MULTI ||
      type === RowActionType.SINGLE
    );
  }

  _updateRowService() {
    this.rowSelectionService.updateState(
      this._rowData,
      this._rowActionType === RowActionType.SINGLE
    );
  }

  _updateColumnDataSource() {
    if (this._rowActionType !== RowActionType.NONE) {
      // append rowAction object to columnDataSource
      const rowAction = {
        id: `__rowAction__${this._rowActionType}`,
        type: this._rowActionType,
        isRowAction: true,
      } as ColumnDataItem;

      this._columnDataSource.next(
        [rowAction].concat(
          this._columnDataSource.getValue().slice()
        )
      );
    } else {
      // remove rowAction object from columnDataSource
      if (
        this._columnDataSource.getValue()[0] &&
        this._columnDataSource.getValue()[0].isRowAction
      ) {
        this._columnDataSource.next(
          this._columnDataSource.getValue().slice(1)
        );
      }
    }
  }
}

