import {
  Component,
  OnInit,
  ViewEncapsulation,
  ContentChild,
  Input,
  ViewContainerRef,
  AfterContentInit,
  ChangeDetectorRef,
  ChangeDetectionStrategy,
  TemplateRef,
  OnDestroy,
  Output,
  EventEmitter,
} from '@angular/core';
import { TemplatePortal } from '@angular/cdk/portal';
import { coerceBooleanProperty } from '@angular/cdk/coercion';
import { Observable, BehaviorSubject } from 'rxjs';
import {
  distinctUntilChanged,
  filter,
  take,
} from 'rxjs/operators';
import { DisclosureLazyContentDirective } from './disclosure-lazy-content.directive';
import { DisclosureHeaderComponent } from './disclosure-header/disclosure-header.component';
import { DisclosureContentDirective } from './disclosure-content.directive';
import { VdsLibService } from '../vds-lib.service';
import {
  DisclosureContainerConfig,
  DisclosureContentConfig,
  DISCLOSURE_ID_PREFIX,
} from './disclosure.constant';
/**
 * DisclosureComponent use DisclosureHeaderComponent controls the visibility of content.
 * It can have use either DisclosureContentDirective or DisclosureLazyContentDirective
 */

@Component({
  selector: 'vds-disclosure',
  templateUrl: './disclosure.component.html',
  encapsulation: ViewEncapsulation.None,
  changeDetection: ChangeDetectionStrategy.OnPush,
  styleUrls: ['./disclosure.component.scss'],
})
export class DisclosureComponent
  implements OnInit, AfterContentInit, OnDestroy {
  /**
   * Whether disclosure is expanded <br>
   * Default: <code>false</code>
   */
  @Input()
  get isExpanded(): boolean {
    return this._expanded;
  }
  set isExpanded(expanded: boolean) {
    this._expanded = coerceBooleanProperty(expanded);
    if (this._panelHeader) {
      this._panelHeader.isOpen = this.isExpanded;
    }
    if (expanded) {
      this.lazyContentLoadedSubject.next(true);
    }
  }
  _expanded = false;

  /**
   * Whether disclosure is disabled <br>
   * Default: <code>false</code>
   */
  @Input()
  get isDisabled(): boolean {
    return this._isDisabled;
  }
  set isDisabled(disabled: boolean) {
    this._isDisabled = coerceBooleanProperty(disabled);
    if (this._panelHeader) {
      this._panelHeader.disabled = this.isDisabled;
    }
  }
  _isDisabled = false;

  /**
   * Whether disclosure is lazyLoading <br>
   * Default: <code>false</code>
   */
  @Input()
  get isLazyLoading(): boolean {
    return this._isLazyLoading;
  }

  set isLazyLoading(isLazy: boolean) {
    this._isLazyLoading = coerceBooleanProperty(isLazy);
  }
  _isLazyLoading = false;

  /**
   * provide id, extra class to disclosure container <br>
   * Default: <code>null</code>
   */
  @Input()
  get containerProps(): DisclosureContainerConfig {
    return this._containerProps;
  }
  set containerProps(props: DisclosureContainerConfig) {
    this._containerProps = {
      ...this._containerProps,
      ...props,
    };
  }
  _containerProps: DisclosureContainerConfig;

  /**
   * provide id, extra class to disclosure content <br>
   * Default: <code>null</code>
   */
  @Input()
  get contentProps(): DisclosureContentConfig {
    return this._contentProps;
  }
  set contentProps(props: DisclosureContentConfig) {
    this._contentProps = {
      ...this._contentProps,
      ...props,
    };
    if (
      this._contentProps &&
      this._contentProps.id &&
      this._panelHeader
    ) {
      this._panelHeader.ariaControls = this._contentProps.id;
    }
  }
  _contentProps: DisclosureContentConfig;

  /**
   * Fires when header is clicked. <br>
   * Returns the boolean to indicate the open state of disclosure
   */
  @Output() toggleHeader = new EventEmitter<boolean>();

  lazyContentLoadedSubject: BehaviorSubject<
    boolean
  > = new BehaviorSubject<boolean>(false);
  lazyContentLoaded$: Observable<
    boolean
  > = this.lazyContentLoadedSubject.asObservable();

  @ContentChild(DisclosureHeaderComponent)
  _panelHeader: DisclosureHeaderComponent;

  /** Content that will be rendered lazily. */
  @ContentChild(DisclosureLazyContentDirective)
  _lazyContent: DisclosureLazyContentDirective;

  @ContentChild(DisclosureContentDirective, {
    read: TemplateRef,
  })
  contentDirective: DisclosureContentDirective;

  _portal: TemplatePortal;

  constructor(
    private _viewContainerRef: ViewContainerRef,
    private _changeDetectorRef: ChangeDetectorRef,
    private vdsLibService: VdsLibService
  ) {}

  ngOnInit() {
    if (!this.containerProps || !this.containerProps.id) {
      const uuid = this.vdsLibService.getUUID(
        DISCLOSURE_ID_PREFIX
      );
      if (!this.containerProps) {
        this.containerProps = {};
      }
      this.containerProps.id = uuid;
    }
  }

  ngAfterContentInit() {
    if (this._lazyContent) {
      this.lazyContentLoaded$
        .pipe(
          distinctUntilChanged(),
          filter(() => {
            return this.isExpanded && !this._portal;
          }),
          take(1)
        )
        .subscribe(() => {
          this._portal = new TemplatePortal(
            this._lazyContent._template,
            this._viewContainerRef
          );
        });
    }

    if (this._panelHeader) {
      this._panelHeader.isOpen = this.isExpanded;
      this._panelHeader.disabled = this.isDisabled;
      if (this._contentProps && this._contentProps.id) {
        this._panelHeader.ariaControls = this._contentProps.id;
      }

      this._panelHeader.toggleEventState$.subscribe(() => {
        if (!this.isDisabled) {
          this.isExpanded = !this.isExpanded;
          this.toggleHeader.emit(this.isExpanded);
          this._changeDetectorRef.markForCheck();
        }
      });
    }
  }

  ngOnDestroy() {
    this.lazyContentLoadedSubject.complete();
  }
}

