import {
  Component,
  OnInit,
  OnDestroy,
  Input,
  ViewEncapsulation,
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  ViewChild,
  ElementRef,
} from '@angular/core';
import { coerceBooleanProperty } from '@angular/cdk/coercion';
import { Subject } from 'rxjs';
import { DisclosureHeaderConfig } from '../disclosure.constant';
/**
 * DisclosureHeaderComponent is a clickable component which controls visibility of content
 */
@Component({
  selector: 'vds-disclosure-header',
  templateUrl: './disclosure-header.component.html',
  encapsulation: ViewEncapsulation.None,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class DisclosureHeaderComponent
  implements OnInit, OnDestroy {
  /**
   * Whether disclosure is open <br>
   * Default: <code>false</code>
   */
  @Input()
  get isOpen(): boolean {
    return this._isOpen;
  }
  set isOpen(open: boolean) {
    this._isOpen = coerceBooleanProperty(open);
  }
  _isOpen = false;

  /**
   * Whether disclosure showToggle <br>
   * Default: <code>false</code>
   */
  @Input()
  get showToggle(): boolean {
    return this._showToggle;
  }
  set showToggle(show: boolean) {
    this._showToggle = coerceBooleanProperty(show);
  }
  _showToggle = true;

  /**
   * Whether disclosure is disabled <br>
   * Default: <code>false</code>
   */
  @Input()
  get disabled(): boolean {
    return this._disabled;
  }
  set disabled(disabled: boolean) {
    this._disabled = coerceBooleanProperty(disabled);
    this._changeDetectorRef.markForCheck();
  }
  _disabled = false;

  /**
   * aria-controls for disclosure <br>
   * Default: <code>null</code>
   */
  @Input()
  get ariaControls(): string {
    return this._ariaControls;
  }
  set ariaControls(control: string) {
    this._ariaControls = control;
  }
  _ariaControls: string = null;

  /**
   * Header props for disclosure <br>
   * Default: <code> {
   *   iconType: 'tiny',
   *   openIcon: 'subtract',
   *   closeIcon: 'add'
   * } </code>
   */
  @Input()
  get headerProps(): DisclosureHeaderConfig {
    return this._headerProps;
  }
  set headerProps(props: DisclosureHeaderConfig) {
    this._headerProps = { ...this._headerProps, ...props };
  }
  _headerProps: DisclosureHeaderConfig = {
    iconType: 'tiny',
    openIcon: 'subtract',
    closeIcon: 'add',
  };

  /**
   * Whether disclosure should block child component event<br>
   * Default: <code>true</code>
   */
  @Input()
  get blockChildEvent(): boolean {
    return this._blockChildEvent;
  }
  set blockChildEvent(block: boolean) {
    this._blockChildEvent = coerceBooleanProperty(block);
  }
  _blockChildEvent = false;

  /**
   * focus header after click<br>
   * Default: <code>false</code>
   */
  @Input()
  get focusHeaderAfterClick(): boolean {
    return this._focusHeader;
  }
  set focusHeaderAfterClick(focus: boolean) {
    this._focusHeader = coerceBooleanProperty(focus);
  }
  _focusHeader = false;

  constructor(
    private _changeDetectorRef: ChangeDetectorRef
  ) {}

  toggleEvent: Subject<void> = new Subject<void>();
  public toggleEventState$ = this.toggleEvent.asObservable();

  @ViewChild('header') el: ElementRef;

  ngOnInit() {}

  ngOnDestroy() {
    this.toggleEvent.complete();
  }

  toggleHeader() {
    this.toggleEvent.next();
    if (this.focusHeaderAfterClick) {
      this.el.nativeElement.focus();
    }
  }

  handleEscape() {
    if (this.isOpen) {
      this.toggleEvent.next();
    }
  }
}

