import { Component, OnInit, Input } from '@angular/core';
import {
  UNIT_DEFAULT,
  LABEL_DEFAULT,
} from './linear-progress.constants';

@Component({
  selector: 'vds-linear-progress',
  templateUrl: './linear-progress.component.html',
})
export class LinearProgressComponent implements OnInit {
  /**
   * Sets the type of progress bar.
   */
  @Input() determinate = false;
  /**
   * The number corresponding to the quantity
   * of processed data in a *determinate* progress bar.
   */
  @Input() loaded = 0;
  /**
   * The number to which percentages are expressed.
   * Set to '0' by default
   */
  @Input() mantissa = 0;
  /**
   * Sets the border radius style.
   */
  @Input() rounded = false;
  /**
   * The number corresponding to the total quantity
   * of expected data in a *determinate* progress bar.
   */
  @Input() total = 0;
  /**
   * The data units in a *determinate* progress bar.
   */
  @Input() units: string = UNIT_DEFAULT;

  label: string;
  percentage: string;

  constructor() {}

  ngOnInit() {
    if (this.determinate) {
      this.label = `${LABEL_DEFAULT.FIRST_CLAUSE}, ${
        this.percentage
      } ${LABEL_DEFAULT.SECOND_CLAUSE}`;
    } else {
      this.label = LABEL_DEFAULT.FIRST_CLAUSE;
    }
    this.total = this.total > 0 ? this.total : 0;
    if (this.loaded > this.total) {
      this.loaded = this.total;
    }
    if (this.loaded < 0) {
      this.loaded = 0;
    }
    this.percentage = this.calculatePercentage();
  }

  calculatePercentage(): string {
    let num: string;
    if (this.loaded === 0 || this.total === 0) {
      num = '0';
    } else {
      num = `${((this.loaded / this.total) * 100).toFixed(
        this.mantissa
      )}`;
    }
    num = parseInt(num, 10) > 100 ? '100' : num;
    return `${num}%`;
  }
}

