    event.preventDefault();
  }

  select(event) {
    this.stopEvents(event);
    const el: Element = event.target as Element;
    let theIndex: string = el.getAttribute(
      LISTBOX.ATTRIBUTES.DATA_INDEX
    );
    if (
      el
        .getAttribute(LISTBOX.ATTRIBUTES.CLASS)
        .indexOf(LISTBOX.ATTRIBUTES.CHECKBOX) !== -1
    ) {
      theIndex = el
        .getAttribute(LISTBOX.ATTRIBUTES.FOR)
        .split(
          LISTBOX.ATTRIBUTES.CHECKBOX +
            LISTBOX.SYMBOLS.HYPHEN
        )[1]
        .split(LISTBOX.SYMBOLS.HYPHEN)[0];
    }
    this.currentIndex = parseInt(theIndex, 10);
    if (this.isMultiselect) {
      this.changeMultiSelectStatusQuo();
      return;
    }
    this.changeStatusQuo();
  }

  goingUp() {
    this.stopEvents(event);
    if (this.currentIndex === 0) {
      return;
    }
    this.currentIndex -= 1;
    if (this.isMultiselect) {
      return;
    }
    this.changeStatusQuo();
  }

  comingDown() {
    this.stopEvents(event);
    if (this.currentIndex === this.items.length - 1) {
      return;
    }
    this.currentIndex += 1;
    if (this.isMultiselect) {
      return;
    }
    this.changeStatusQuo();
  }

  selectMultiSelectItem() {
    this.stopEvents(event);
    if (this.isMultiselect) {
      this.changeMultiSelectStatusQuo();
    }
  }

  changeStatusQuo() {
    this.value = this.items[this.currentIndex].value;
    this.activeDescendent =
      this.listboxListItem +
      LISTBOX.SYMBOLS.HYPHEN +
      this.currentIndex;
    this.selectedItems = [
      {
        label: this.items[this.currentIndex].label,
        value: this.value,
      },
    ];
    this.change.emit(this.selectedItems);
  }

  checkForPreSelectedItems() {
    if (this.selectedItems && this.selectedItems.length) {
      this.activeDescendent =
        this.listboxListItem +
        LISTBOX.SYMBOLS.HYPHEN +
        this.findSingleSelectionPosition();

      if (!this.isMultiselect) {
        this.value = this.selectedItems[0].value;
        this.change.emit(this.selectedItems);
        return;
      }

      const multiSelectInputItems = {};
      let newValue = '';
      this.value = '';
      this.selectedItems.map((item) => {
        multiSelectInputItems[item.value] = true;
      });
      this.items.map((item) => {
        if (multiSelectInputItems[item.value]) {
          item.checked = true;
          newValue += item.value + LISTBOX.SYMBOLS.COMMA;
        }
      });
      this.value = newValue;
      this.change.emit(this.selectedItems);
    }
  }

  findSingleSelectionPosition(): number {
    const that = this;
    let foundIndex = -1;
    this.items.forEach((item, index) => {
      if (that.selectedItems[0].value === item.value) {
        foundIndex = index;
      }
    });
    return foundIndex;
  }

  changeMultiSelectStatusQuo() {
    const that = this;
    let newValue = '';
    this.value = '';
    this.selectedItems = [];
    this.activeDescendent =
      this.listboxListItem +
      LISTBOX.SYMBOLS.HYPHEN +
      this.currentIndex;
    this.items[this.currentIndex].checked = this.items[
      this.currentIndex
    ].checked
      ? !this.items[this.currentIndex].checked
      : true;
    this.items.map((item) => {
      if (item.checked) {
        that.selectedItems.push({
          label: item.label,
          value: item.value,
        });
        newValue += item.value + LISTBOX.SYMBOLS.COMMA;
      }
    });
    this.value = newValue;
    this.change.emit(this.selectedItems);
  }
}

