import {
  ChangeDetectionStrategy,
  Component,
  EventEmitter,
  Input,
  OnInit,
  OnDestroy,
  Output,
  ViewEncapsulation,
  OnChanges,
  HostListener,
  SimpleChanges,
} from '@angular/core';
import { BehaviorSubject, Subject } from 'rxjs';
import { coerceNumberProperty } from '@angular/cdk/coercion';
import { SPACE } from '@angular/cdk/keycodes';
import {
  PageEvent,
  PAGINATION,
  sortFn,
} from './pagination.constant';
import { VdsLibService } from '../vds-lib.service';

@Component({
  selector: 'vds-pagination',
  templateUrl: './pagination.component.html',
  changeDetection: ChangeDetectionStrategy.OnPush,
  encapsulation: ViewEncapsulation.None,
})
export class PaginationComponent
  implements OnInit, OnChanges, OnDestroy {
  /**
   * Class for container <div> wrapping Pagination component <br>
   * Default: <code>null</code>
   */
  @Input() containerClass = null;

  /**
   * Whether component is disabled <br>
   * Default: <code>false</code>
   */
  @Input() disabled = false;

  /**
   * If true, a page size dropdown will accompany the paginator <br>
   * Default: <code>false</code>
   */
  @Input() displayPageSize = false;

  /**
   * If true, a page count display will accompany the paginator <br>
   * Default: <code>false</code>
   */
  @Input() displayPageCount = false;

  /**
   * Aria label for 'first page' button <br>
   * Default: <code>'First Page'</code>
   */
  @Input() ariaFirstPage = 'First Page';

  /**
   * Aria label for 'previous page' button <br>
   * Default: <code>'Previous Page'</code>
   */
  @Input() ariaPreviousPage = 'Previous Page';

  /**
   * Aria label for 'next page' button <br>
   * Default: <code>'Next Page'</code>
   */
  @Input() ariaNextPage = 'Next Page';

  /**
   * Aria label for 'last page' button <br>
   * Default: <code>'Last Page'</code>
   */
  @Input() ariaLastPage = 'Last Page';

  /**
   * Text to accompany page size dropdown <br>
   * Default: <code>'ITEMS'</code>
   */
  @Input() pageSizeText = 'ITEMS';

  /**
   * The zero-based page index of the displayed list of items <br>
   * Default: <code>0</code>
   */
  @Input()
  get pageIndex(): number {
    return this._pageIndex;
  }
  set pageIndex(value: number) {
    const numOfPages = this.numberOfPages();
    const newValue = Math.max(
      coerceNumberProperty(value),
      0
    );

    this._pageIndex =
      numOfPages > 0
        ? Math.min(newValue, numOfPages)
        : newValue;

    this._constructPageNumbers();
  }
  _pageIndex = 0;

  /**
   * Number of items to display on a page <br>
   * Default: <code>null</code>
   */
  @Input()
  get pageSize(): number {
    return this._pageSize;
  }
  set pageSize(value: number) {
    this._pageSize = coerceNumberProperty(value);

    this._validatePageSizeAndPageSizeOptions();

    this._constructPageNumbers();
  }
  _pageSize = null;

  /**
   * The set of provided page size options to display to the user <br>
   * Default: <code>[]</code>
   */
  @Input()
  get pageSizeOptions(): number[] {
    return this._pageSizeOptions;
  }
  set pageSizeOptions(value: number[]) {
    this._pageSizeOptions = (value || [])
      .map((p) => {
        p = coerceNumberProperty(p);
        if (p > 0) {
          return p;
        }

        return null;
      })
      .filter(Boolean);

    this._validatePageSizeAndPageSizeOptions();
  }
  _pageSizeOptions: number[] = [];

  /**
   * The length of the total number of items that are being paginated <br>
   * Default: <code>0</code>
   */
  @Input()
  get length(): number {
    return this._length;
  }
  set length(value: number) {
    this._length = coerceNumberProperty(value);
    this._constructPageNumbers();
  }
  _length = 0;

  /**
   * Fires when a page index or page size has changed
   */
  @Output() paginationEvent: EventEmitter<
    PageEvent
  > = new EventEmitter<PageEvent>();

  _menuOpen = false;
  _stateChange = new Subject();
  _displayedPageNumbers = new BehaviorSubject<number[]>([]);

  stateChange$ = this._stateChange.asObservable();
  displayedPageNumbers$ = this._displayedPageNumbers.asObservable();

  @HostListener('document:click')
  clickOut() {
    if (this._menuOpen && !this.disabled) {
      this._menuOpen = false;
    }
  }

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );

    if (this.pageIndex > this.numberOfPages()) {
      this.pageIndex = this.numberOfPages();
    }

    this._constructPageNumbers();
  }

  ngOnChanges(changes: SimpleChanges) {
    this._emitStateChange();

    if (
      (changes.length && !changes.length.firstChange) ||
      (changes.pageSize && !changes.pageSize.firstChange)
    ) {
      this.pageIndex = 0;
    }
  }

  ngOnDestroy() {
    this._stateChange.complete();
    this._displayedPageNumbers.complete();
  }

  firstPage() {
    const previousIndex = this.pageIndex;
    this.pageIndex = 0;
    this._emitPageEvent(previousIndex);
  }

  previousPage() {
    const previousIndex = this.pageIndex;
    this.pageIndex = Math.max(0, this.pageIndex - 1);
    this._emitPageEvent(previousIndex);
  }

  lastPage() {
    const previousIndex = this.pageIndex;
    this.pageIndex = this.numberOfPages();
    this._emitPageEvent(previousIndex);
  }

  nextPage() {
    const previousIndex = this.pageIndex;
    this.pageIndex = Math.min(
      this.numberOfPages(),
      this.pageIndex + 1
    );
    this._emitPageEvent(previousIndex);
  }

  handlePageSelect(page: number) {
    const previousIndex = this.pageIndex;
    this.pageIndex = page;
    this._emitPageEvent(previousIndex);
  }

  handleDropdownSelect(event) {
    event.stopPropagation();
    this._menuOpen = !this._menuOpen;
  }

  handleListboxSelect(event) {
    const pageSize = event.target.getAttribute(
      PAGINATION.DATA_ATTR_PAGE_SIZE_ITEM
    );
    if (
      (event.type === 'keydown' && event.which === SPACE) ||
      event.type === 'click'
    ) {
      event.preventDefault();
      event.stopPropagation();
      const previousIndex = this.pageIndex;
      this._menuOpen = false;
      this.pageSize = pageSize;
      this.pageIndex = 0;
      this._emitPageEvent(previousIndex);
    }
  }

  previousButtonsDisabled() {
    return (
      this.disabled ||
      !(this.pageIndex >= 1 && this.pageSize !== 0)
    );
  }

  nextButtonsDisabled() {
    return (
      this.disabled ||
      !(
        this.pageIndex < this.numberOfPages() &&
        this.pageSize !== 0
      )
    );
  }

  numberOfPages() {
    return Math.ceil(this.length / this.pageSize) - 1;
  }

  _constructPageNumbers() {
    if (this.length === 0) {
      return this._displayedPageNumbers.next([]);
    }

    const lastPage = this.numberOfPages() + 1;
    const adjPageIndex = this.pageIndex + 1;
    const blockLimit =
      adjPageIndex <= PAGINATION.START_END_LIMIT ||
      lastPage - adjPageIndex < PAGINATION.START_END_LIMIT
        ? PAGINATION.START_END_LIMIT
        : PAGINATION.MIDDLE_LIMIT;
    const modIndex = this.pageIndex % blockLimit;
    const beginBlock = [1, null];
    const endBlock = [null, lastPage];

    if (lastPage <= PAGINATION.PAGE_LIMIT) {
      // no need to do anything fancy if `lastPage <= PAGE_LIMIT`
      this._displayedPageNumbers.next(
        Array.from({ length: lastPage }, (v, i) => i + 1)
      );
    } else if (
      blockLimit === PAGINATION.START_END_LIMIT &&
      adjPageIndex > blockLimit
    ) {
      // when we are at tail end of pagination we simply use the last 7 page numbers
      this._displayedPageNumbers.next(
        beginBlock.concat(
          Array.from(
            { length: PAGINATION.START_END_LIMIT },
            (v, i) => lastPage - i
          ).sort(sortFn)
        )
      );
    } else {
      const leftBlock = Array.from(
        { length: modIndex },
        (v, i) => this.pageIndex - i
      ).sort(sortFn);
      const rightBlock =
        blockLimit >= this.pageIndex
          ? Array.from(
              { length: blockLimit - this.pageIndex },
              (v, i) => blockLimit - i
            ).sort(sortFn)
          : Array.from(
              { length: blockLimit - modIndex },
              (v, i) => adjPageIndex + i
            );

      this._displayedPageNumbers.next(
        blockLimit === PAGINATION.START_END_LIMIT
          ? leftBlock.concat(rightBlock).concat(endBlock)
          : beginBlock
              .concat(leftBlock.concat(rightBlock))
              .concat(endBlock)
      );
    }

    this._getPageCountText();
  }

  _getPageCountText() {
    const leftMarker = this.pageSize * this.pageIndex + 1;
    const rightMarker =
      this.pageIndex !== this.numberOfPages()
        ? this.pageSize * (this.pageIndex + 1)
        : this.length;

    return `${leftMarker} - ${rightMarker} of ${
      this.length
    }`;
  }

  _validatePageSizeAndPageSizeOptions() {
    if (!this._pageSize) {
      this._pageSize =
        this._pageSizeOptions.length > 0
          ? this._pageSizeOptions[0]
          : PAGINATION.DEFAULT_PAGESIZE;
    }

    if (!this._pageSizeOptions.includes(this._pageSize)) {
      let pageSizeOptions = this._pageSizeOptions.slice();
      pageSizeOptions.push(this._pageSize);
      pageSizeOptions = pageSizeOptions.sort(sortFn);
      this._pageSizeOptions = pageSizeOptions;
    }
  }

  _emitPageEvent(previousPageIndex: number = null) {
    this._emitStateChange();

    this.paginationEvent.emit({
      previousPageIndex,
      pageIndex: this.pageIndex,
      pageSize: this.pageSize,
      length: this.length,
    });
  }

  _emitStateChange() {
    this._stateChange.next({
      pageIndex: this.pageIndex,
      pageSize: this.pageSize,
      length: this.length,
    });
  }
}

