   * The user display label of the radio.
   */
  @Input() label: string;
  /**
   * The name of the input element.
   */
  @Input() name: string;
  /**
   * The value of the input element.
   */
  @Input() value: string;
  /**
   * Emits changed value.
   */
  @Output() change = new EventEmitter<any>();

  public focused = false;
  public radioID: string;
  public radioName: string;
  public radioValue: string;

  RADIO = RADIO;

  constructor(
    private cdRef: ChangeDetectorRef,
    private vdsLibService: VdsLibService
  ) {
    super();
  }

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(RADIO.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + RADIO.SUFFIX.NAME;
    this.radioID = `${this.id}${RADIO.SUFFIX.NATIVE}`;
    this.radioName = `${this.name}${RADIO.SUFFIX.NATIVE}`;
    this.checked = this.vdsLibService.triageDisabledValue(
      this.checked
    );
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
    this.invalid = this.vdsLibService.triageDisabledValue(
      this.invalid
    );
    this.radioValue = this.value;
  }

