    this.checkAndWrite();
    event.stopPropagation();
  }

  onKeyDown(event: KeyboardEvent): void {
    this.checkAndWrite();
    event.stopPropagation();
    event.preventDefault();
  }

  onFocus(): void {
    this.focused = true;
  }

  onBlur(): void {
    this.focused = false;
  }
