import {
  Component,
  OnInit,
  Input,
  EventEmitter,
  Output,
} from '@angular/core';
import { Star } from './rating.interfaces';
import { RATING_ICON, DEFAULT } from './rating.constants';
import { coerceNumberProperty } from '@angular/cdk/coercion';
import { VdsLibService } from '../vds-lib.service';

@Component({
  selector: 'vds-rating',
  templateUrl: './rating.component.html',
})
export class RatingComponent implements OnInit {
  /**
   * Total number of stars in rating.
   */
  @Input() total: number;
  /**
   * Presets rating value.
   */
  @Input() value: number;
  /**
   * Outputs value on select (1 indexed).
   */
  @Output() select: EventEmitter<
    number
  > = new EventEmitter();

  DASH = DEFAULT.DASH;
  ICONS = RATING_ICON;
  _id: string;
  _stars: Array<Star> = [];
  focusedStar: Star;
  selectedStar: Star;

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.total = this.total
      ? coerceNumberProperty(this.total)
      : DEFAULT.TOTAL;
    this.value = this.total
      ? coerceNumberProperty(this.value)
      : DEFAULT.FILLED;
    this._id = this.vdsLibService.getUUID();
    if (this.value > this.total) {
      this.value = this.total;
    }
    for (let i = 0; i < this.total; i++) {
      this._stars.push({
        hovered: false,
        selected: i < this.value,
        focused: false,
        id: i + 1,
      });
    }
  }

  onHover(num: number) {
    for (let i = num - 1; i >= 0; i--) {
      this._stars[i].hovered = true;
    }
  }

  onBlur(num: number) {
    for (let i = num - 1; i >= 0; i--) {
      this._stars[i].hovered = false;
    }
  }

  onSelect(star: Star) {
    this.focus(star.id);
    this._stars.forEach((_star: Star) => {
      switch (_star.id <= star.id) {
        case true:
          _star.selected = true;
          break;
        case false:
        default:
          _star.selected = false;
          break;
      }
    });
    this.focus(star.id);
    this.selectedStar = star;
    this.select.emit(star.id);
  }

  focus(starID: number) {
    if (this.focusedStar) {
      this.focusedStar.focused = false;
    }
    this.focusedStar = this._stars[starID - 1];
    this.focusedStar.focused = true;
  }

  loseFocus() {
    if (this.focusedStar) {
      this.focusedStar.focused = false;
      this.focusedStar = null;
    }
  }
}

