  get name(): string {
    return this._name;
  }
  set name(value) {
    this._name = value;
  }
  _name: string;

  /**
   * Placeholder string for the search term.
   */
  @Input()
  get placeholder(): string {
    return this._placeholder;
  }
  set placeholder(value) {
    this._placeholder = value;
  }
  _placeholder: string;

  /**
   * Variant specification for the type of search.
   */
  @Input()
  get variant(): SearchVariant {
    return this._variant;
  }
  set variant(value) {
    this._variant = value;
  }
  _variant: SearchVariant = SearchVariant.STANDARD;

  /**
   * Emits selection from assist menu.
   */
  @Output() assistSelection = new EventEmitter<any>();

  /**
   * Emits search event with keyword value.
   */
  @Output() search = new EventEmitter<any>();

  blurHappened: boolean;
  expanded: boolean;
  focused: boolean;
  inputId: string;
  SearchVariantType = SearchVariant;
  showClear: boolean;

  constructor(
    private vdsLibService: VdsLibService,
    private cdRef: ChangeDetectorRef
  ) {
    super();
  }

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(SEARCH.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + SEARCH.SUFFIX.NAME;
    this.inputId = `${this.id}${SEARCH.SUFFIX.NATIVE}`;
  }

  searchTriggered(el) {
    // this.search.emit({
    //   keyword: el.value,
    // });
    this.writeValue(el.value);
  }

  searchIntended(el, blur, event) {
    this.focused = false;
    if (blur) {
      this.blurHappened = true;
      setTimeout(() => {
        this.blurHappened = false;
      }, 200);
      if (el.value.length) {
        this.expanded = true;
        return;
      }
      this.expanded = false;
      return;
    }
    if (el.value.length && this.expanded) {
      this.expanded = true;
      this.writeValue(el.value);
      return;
    }
    if (!el.value.length && this.expanded) {
      this.expanded = false;
      return;
    }
    if (this.blurHappened && !this.expanded) {
      this.expanded = false;
      return;
    }
    if (!this.expanded && !this.blurHappened) {
      this.expanded = true;
      this.searchExpandableEl.nativeElement.focus();
    }
  }

  onFocus(event?: Event): void {
    this.expanded = true;
    this.focused = true;
  }

  // onBlur(event, el): void {
  //   this.focused = false;
  //   // if (!el.value) {
  //   //   this.expanded = false;
  //   // }
  // }

  onTypingDynamic(el) {
    this.writeValue(el.value);
    if (el.value.length) {
      this.showClear = true;
      return;
    }
    this.showClear = false;
  }

  clearDynamicVal(el) {
    el.value = '';
    this.showClear = false;
    this.writeValue(el.value);
  }

  assistListItemSelected(item, el) {
    this.assistSelection.emit(item[0]);
    this.clearDynamicVal(el);
  }

  writeValue(value: any) {
    super.writeValue(value);
    this.value = value;
    this.cdRef.detectChanges();
    if (
      this.variant === SearchVariant.DYNAMIC ||
      this.variant === SearchVariant.CONTEXTUAL
    ) {
      if (value.length >= this.assistLength) {
        this.search.emit({
          keyword: value,
        });
      }
      return;
    }
    this.search.emit({
      keyword: value,
    });
  }
}

