 * SidenavComponent contains three section: SidenavHeaderDirective, SidenavLinksMenuComponent,
 * SidenavFooterDirective.
 * SidenavComponent has two major state: normal and mini state, activeLink use to maintain the state
 * of the active link.
 */
@Component({
  selector: 'vds-sidenav',
  templateUrl: './sidenav.component.html',
  changeDetection: ChangeDetectionStrategy.OnPush,
  encapsulation: ViewEncapsulation.None,
  providers: [SidenavService],
  styleUrls: ['./sidenav.component.scss'],
})
export class SidenavComponent implements OnInit {
  /**
   * Whether is mini sidenav <br>
   * Default: <code>false</code>
   */
  @Input()
  get isMini(): boolean {
    return this._isMini;
  }
  set isMini(mini: boolean) {
    this._isMini = coerceBooleanProperty(mini);
  }
  _isMini = false;

  /**
   * Sets the color scheme by application type. <br>
   * Options are 'default', 'marketing', 'light', and 'consumer'. <br>
   * Default: <code>COLOR_SCHEME.default</code>
   */
  @Input()
  get colorScheme(): string {
    return this._colorScheme;
  }
  set colorScheme(scheme: string) {
    if (COLORSCHEME[scheme.toLowerCase()]) {
      this._colorScheme = scheme;
    }
  }
  _colorScheme: string = COLORSCHEME.default;

  /**
   * Sets the sidenav positioning.  <br>
   * Options are 'fixed', 'absolute' or 'relative'. <br>
   * Default: <code>POSITION.relative</code>
   */
  @Input()
  get position(): string {
    return this._position;
  }

  set position(pos: string) {
    if (POSITION[pos.toLowerCase()]) {
      this._position = pos;
    }
  }
  _position: string = POSITION.relative;

  get COLOR_SCHEME() {
    return COLORSCHEME;
  }

  /**
   *  activeLink keep track of current selected link for mini nav. <br>
   *  If you programmatically route to other page using this.router.navigate(),<br>
   *  please set activeLink in order to make mini sidenav work. <br>
   *  Default: <code>null</code>
   */
  @Input()
  get activeLink(): any {
    return this._activeLink;
  }
  set activeLink(link: any) {
    this._activeLink = { ...this._activeLink, ...link };
  }
  _activeLink: any;

  /**
   * provide id, extra class to sidenav <br>
   * Default: <code>null</code>
   */
  @Input()
  get sidenavProps(): SidenavProps {
    return this._sidenavProps;
  }
  set sidenavProps(props: SidenavProps) {
    this._sidenavProps = {
      ...this._sidenavProps,
      ...props,
    };
  }
  _sidenavProps: SidenavProps;

  /**
   * sidenavConfig prop use to control the visibility of header and footer.<br>
   * Also you can set unique field for the sidenav-list-item<br>
   * Default: <code>{
   *   showHeader: true,
   *   showFooter: true,
   *   key: 'label'
   * }</code>
   */
  @Input()
  get sidenavConfig(): SidenavConfig {
    return this._sidenavConfig;
  }

  set sidenavConfig(props: SidenavConfig) {
    this._sidenavConfig = {
      ...this._sidenavConfig,
      ...props,
    };
  }
  _sidenavConfig: SidenavConfig = {
    showHeader: true,
    showFooter: true,
    key: 'label',
  };

  constructor(
    public sidenavService: SidenavService,
    private _changeDetectorRef: ChangeDetectorRef
  ) {}

  /**
   *  Fires when sidenav become mini. <br>
   *  Returns the boolean to indicate the mini state of sidenav
   */
  @Output() toggleMini: EventEmitter<
    boolean
  > = new EventEmitter<boolean>();

  /**
   * Fires when user select nav-item  <br>
   * Emits select event in both sidenav and sidenav-list-item. <br>
   * Returns current select nav item
   */
  @Output() selectEvent = new EventEmitter<any>();

  @ContentChild(SidenavHeaderDirective, {
    read: TemplateRef,
  })
  sidenavHeaderDirective: SidenavHeaderDirective;

  @ContentChild(SidenavFooterDirective, {
    read: TemplateRef,
  })
  sidenavFooterDirective: SidenavFooterDirective;

  @ContentChild(SidenavLinksMenuComponent)
  navLinksMenuComponent: SidenavLinksMenuComponent;

  _scroll: number;

  @ViewChild(SidenavScrollDirective)
  scrollDir: SidenavScrollDirective;
  setScroll(scroll: number) {
    this._scroll = scroll;
  }

  ngOnInit() {
    this.sidenavService
      .getMiniNavObservable()
      .subscribe((isMini) => {
        this._isMini = isMini;
        this.handleScroll();
        this.handleMini();
        this.toggleMini.emit(isMini);
        this._changeDetectorRef.markForCheck();
      });

    this.sidenavService
      .getSelectItemObservable()
      .subscribe((item) => {
        this.selectEvent.emit(item);
        this.activeLink = item;
        this.handleMini();
        this._changeDetectorRef.markForCheck();
      });
  }

  handleScroll() {
    if (this.isMini) {
      this.scrollDir.turnOff = true;
    } else {
      this.scrollDir.turnOff = false;
      this.scrollDir.reset(this._scroll);
      this._changeDetectorRef.markForCheck();
    }
  }

  handleMini() {
    if (
      this.isMini &&
      this.activeLink &&
      this.navLinksMenuComponent &&
      this.navLinksMenuComponent.navListItemComponents
    ) {
      for (const itemComponent of this.navLinksMenuComponent.navListItemComponents.toArray()) {
        if (itemComponent.hasChildren) {
          this.handleActiveLink(itemComponent);
        }
      }
    }
  }

  handleActiveLink(itemComponent) {
    const navItemChildren =
      itemComponent.navListItem.children;
    itemComponent.showActive = false;
    for (const navItemChild of navItemChildren) {
      if (
        navItemChild[this.sidenavConfig.key] ===
        this.activeLink[this.sidenavConfig.key]
      ) {
        itemComponent.showActive = true;
        break;
      }
    }
  }
}

