      }

      .vds-icon {
        @include svg-icon(24px, $color-cloudy);
        padding: 9px;
      }

      .vds-icon--tiny {
        @include svg-icon(16px, $color-cloudy);
        padding: 9px;
      }
    }

    /*  group header, no focus and select state, only active state */
    .sidenav-list-item-label {
      cursor: default;

      &:active {
        box-shadow: 4px 0 0 $color-portage inset;
      }
    }

    /* anchor link, expendable button */
    a,
    .vds-disclosure-header {
      &.vds-tab {
        &:active,
        &.vds-state--active {
          @include sidenav-light-svg-icon($color-white);
          background: none;
          box-shadow: 4px 0 0 $color-portage inset;
          color: $color-white;
        }
      }
    }
  }
}

/* sidenav */
.vds-nav {
  &.vds-nav--vertical {
    @include sidenav-flex-mixin;
    min-height: auto;

    .vds-nav-links {
      @include sidenav-flex-mixin;
      flex: 1 0 auto;
      overflow-x: hidden;
      position: relative;

      .vds-tab-list {
        @include sidenav-flex-mixin;
        @include sidenav-tab-item-mixin;
        flex: 1;
        width: 100%;
      }
    }

    .vds-sidenav-header,
    .vds-sidenav-footer {
      @include sidenav-flex-mixin;
      @include sidenav-tab-item-mixin;
      flex-shrink: 0;
    }
  }
}

/* mini sidenav */
.vds-nav--vertical {
  &.vds-sidenav-mini {
    max-width: 56px;
    min-width: 56px;
    width: 56px;

    .vds-sidenav-header,
    .vds-sidenav-footer {
      max-width: 56px;
    }

    .sidenav-list-item-label {
      display: none;
    }

    .vds-disclosure {
      display: none;
    }
  }
}

.vds-sidenav-container {
  display: flex;
}

/* sidenav toggle button */
.vds-sidenav-toggle-button {
  @include sidenav-light-svg-icon($color-cloudy);
  background: none;
  border: 0;

  &:focus,
  &:active {
    @include sidenav-light-svg-icon($color-white);
  }
}

/*sidenav light theme */
.vds-type--light {
  &.vds-nav {
    &.vds-nav--vertical {
      background: $color-fog;

      .vds-nav-links {
        .vds-tab-item {
          /*  group header, no focus and select state, only active state */
          /* link, all state */
          a,
          span,
          .vds-disclosure-header {
            &.vds-tab {
              @include sidenav-light-svg-icon($color-blue);
              color: $color-indigo;

              &:hover {
                @include sidenav-light-svg-icon(
                  $color-light-blue
                );
                background-color: $color-ice;
                color: $color-light-blue;
              }

              &.vds-state--active,
              &:active {
                @include sidenav-light-svg-icon(
                  $color-light-blue
                );
                background-color: $color-ice;
                box-shadow: 4px 0 0 $color-light-blue inset;
                color: $color-light-blue;
              }

              &:focus,
              &.vds-state--focus {
                @include sidenav-light-svg-icon(
                  $color-light-blue
                );

                &:not(:active) {
                  color: $color-light-blue;
                  outline: 1px dashed $color-night;
                }
              }
            }
          }

          .sidenav-list-item-button {
            @include sidenav-light-svg-icon($color-blue);
            color: $color-indigo;

            &:focus,
            &:active {
              border: 1px dotted $color-night;
            }
          }
        }
      }
    }
  }

  /* sidenav toggle button light theme */
  .vds-sidenav-toggle-button {
    @include sidenav-light-svg-icon($color-blue);
    background: none;
    border: 0;

    &:focus,
    &:active {
      @include sidenav-light-svg-icon($color-light-blue);
    }
  }
}

