import {
  ChangeDetectionStrategy,
  Component,
  ViewChildren,
  Input,
  OnInit,
  TemplateRef,
  QueryList,
  ViewEncapsulation,
} from '@angular/core';
import { coerceBooleanProperty } from '@angular/cdk/coercion';
import { SidenavListItemComponent } from '../sidenav-list-item/sidenav-list-item.component';

/**
 * SidenavLinksMenuComponent can be dataSource driven or html template driven.
 * If useDataSource is true, then SidenavLinksMenuComponent will use navDataList
 * to render SidenavListItemComponent
 * If useDataSource is false, then SidenavLinksMenuComponent will render ng-content
 * and ignore navDataList.
 */
@Component({
  selector: 'vds-sidenav-links-menu',
  templateUrl: './sidenav-links-menu.component.html',
  changeDetection: ChangeDetectionStrategy.OnPush,
  encapsulation: ViewEncapsulation.None,
})
export class SidenavLinksMenuComponent implements OnInit {
  /**
   * custom template for nav link <br>
   * Default: <code>null</code>
   */
  @Input()
  get template(): any {
    return this._template;
  }

  set template(temp: any) {
    this._template = temp;
  }
  _template: TemplateRef<any>;

  /**
   * Whether links menu is dataSource driven <br>
   * Default: <code>true</code>
   */
  @Input()
  get useDataSource(): boolean {
    return this._useDataSource;
  }

  set useDataSource(useDataSource: boolean) {
    this._useDataSource = coerceBooleanProperty(
      useDataSource
    );
  }
  _useDataSource = true;

  @ViewChildren(SidenavListItemComponent)
  navListItemComponents: QueryList<
    SidenavListItemComponent
  >;

  /**
   * provide links menu with data list <br>
   * Default: <code>null</code>
   */
  @Input()
  get navDataList(): any {
    return this._navDataList;
  }

  set navDataList(list: any) {
    this._navDataList = list;
  }
  _navDataList: Array<any>;

  /**
   * provide id, extra class to links menu <br>
   * Default: <code>null</code>
   */
  @Input()
  get menuProps(): any {
    return this._menuProps;
  }

  set menuProps(props: any) {
    this._menuProps = { ...this._menuProps, ...props };
  }
  _menuProps: any;

  constructor() {}

  ngOnInit() {}
}

