import {
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  Component,
  Input,
  OnInit,
  Output,
  TemplateRef,
  EventEmitter,
  ViewEncapsulation,
} from '@angular/core';
import { coerceBooleanProperty } from '@angular/cdk/coercion';
import { SidenavService } from '../sidenav.service';
import {
  SidenavItemType,
  ItemProps,
  ExpandableButton,
} from '../sidenav.constants';
/**
 * SidenavListItemComponent contains five types: navLink, navGroupHeader, navExpandableButton
 * navExpandableButtonLink, navCustomLink
 * navLink, navGroupHeader, navExpandableButton navExpandableButtonLink are pre-defined type
 * navCustomLink use to render custom template which is defined by user
 */
@Component({
  selector: 'vds-sidenav-list-item',
  templateUrl: './sidenav-list-item.component.html',
  changeDetection: ChangeDetectionStrategy.OnPush,
  encapsulation: ViewEncapsulation.None,
})
export class SidenavListItemComponent implements OnInit {
  /**
   * custom template for nav link <br>
   * Default: <code>null</code>
   */
  @Input()
  get template(): any {
    return this._template;
  }

  set template(temp: any) {
    this._template = temp;
  }
  _template: TemplateRef<any>;

  /**
   * provide id, extra class to links menu <br>
   * Default: <code>null</code>
   */
  @Input()
  get itemProps(): ItemProps {
    return this._itemProps;
  }

  set itemProps(props: ItemProps) {
    this._itemProps = { ...this._itemProps, ...props };
  }
  _itemProps: ItemProps;

  /**
   * Whether is mini sidenav <br>
   * Default: <code>false</code>
   */
  @Input()
  get isMini(): boolean {
    return this._isMini;
  }

  set isMini(mini: boolean) {
    this._isMini = coerceBooleanProperty(mini);
  }
  _isMini = false;

  _hasChildren = false;
  get hasChildren(): boolean {
    if (this._navListItem.children) {
      this._hasChildren = coerceBooleanProperty(
        this._navListItem.children.length > 0
      );
    } else {
      this._hasChildren = false;
    }
    return this._hasChildren;
  }

  /**
   * show current nav item as active <br>
   * Default: <code>false</code>
   */
  @Input()
  get showActive(): boolean {
    return this._showActive;
  }

  set showActive(active: boolean) {
    this._showActive = coerceBooleanProperty(active);
  }
  _showActive = false;

  get textButtonProps(): ExpandableButton {
    return this._textButtonProps;
  }
  _textButtonProps: ExpandableButton = {
    headerProps: {
      showToggle: true,
      iconRight: true,
      iconType: 'tiny',
      openIcon: 'arrow-collapse',
      closeIcon: 'arrow-expand',
      class: 'vds-tab',
    },
  };

  get linkButtonProps(): ExpandableButton {
    return this._linkButtonProps;
  }
  _linkButtonProps: ExpandableButton = {
    headerProps: {
      showToggle: true,
      iconType: 'tiny',
      openIcon: 'arrow-collapse',
      closeIcon: 'arrow-expand',
      class: 'sidenav-list-item-button',
    },
  };

  /**
   * navListItem is dataSource for sidenav-list-item <br>
   * Default: <code>{
   *   expanded: true,
   *   disabled: false
   * }</code>
   */
  @Input()
  get navListItem(): any {
    return this._navListItem;
  }

  set navListItem(item: any) {
    this._navListItem = {
      ...this._navListItem,
      ...item,
    };
  }
  _navListItem: any = {
    expanded: true,
    disabled: false,
  };

  get SIDENAV_ITEM_TYPE() {
    return SidenavItemType;
  }

  /**
   * Fires when user select nav-item  <br>
   * Emits select event in both sidenav and sidenav-list-item. <br>
   * Returns current select nav item
   */
  @Output() selectEvent = new EventEmitter<any>();
  emitSelection(navItem) {
    this.selectEvent.emit(navItem);
    this.sidenavService
      .getSelectItemSubject()
      .next(navItem);
  }

  constructor(
    public sidenavService: SidenavService,
    private _changeDetectorRef: ChangeDetectorRef
  ) {}

  ngOnInit() {
    this.sidenavService
      .getMiniNavObservable()
      .subscribe((isMini) => {
        this.isMini = isMini;
        this._changeDetectorRef.markForCheck();
      });
  }
}

import {
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  Component,
  Input,
  OnInit,
  ViewEncapsulation,
} from '@angular/core';
import { SidenavService } from '../sidenav.service';
import { coerceBooleanProperty } from '@angular/cdk/coercion';
import { ButtonProps } from '../sidenav.constants';
/**
 * SidenavToggleButtonComponent use observer pattern to control
 * the mini and normal state for side nav.
 * SidenavToggleButtonComponent can be used in any component that want to
 * control the side nav
 */
@Component({
  selector: 'vds-sidenav-toggle-button',
  templateUrl: './sidenav-toggle-button.component.html',
  changeDetection: ChangeDetectionStrategy.OnPush,
  encapsulation: ViewEncapsulation.None,
})
export class SidenavToggleButtonComponent
  implements OnInit {
  constructor(
    public sidenavService: SidenavService,
    private _changeDetectorRef: ChangeDetectorRef
  ) {}

  /**
   * Whether is mini sidenav <br>
   * Default: <code>false</code>
   */
  @Input()
  get isMini(): boolean {
    return this._isMini;
  }

  set isMini(mini: boolean) {
    this._isMini = coerceBooleanProperty(mini);
  }
  _isMini = false;

  /**
   * provide openIcon, miniIcon to toggle button <br>
   * Default: <code>{
   *   openIcon: 'media-rewind',
   *   closeIcon: 'media-fast-forward',
   *   iconType: 'low'
   * }</code>
   */
  @Input()
  get buttonProps(): ButtonProps {
    return this._buttonProps;
  }

  set buttonProps(props: ButtonProps) {
    this._buttonProps = { ...this._buttonProps, ...props };
  }
  _buttonProps: ButtonProps = {
    openIcon: 'media-rewind',
    closeIcon: 'media-fast-forward',
    iconType: 'low',
  };

  ngOnInit() {
    this.sidenavService
      .getMiniNavObservable()
      .subscribe((isMini) => {
        this.isMini = isMini;
        this._changeDetectorRef.markForCheck();
      });
  }

  toggle() {
    this.isMini = !this.isMini;
    const miniSubject = this.sidenavService.getMiniNavSubject();
    if (miniSubject) {
      miniSubject.next(this.isMini);
    }
    this._changeDetectorRef.markForCheck();
  }
}

import {
  Component,
  OnInit,
  Input,
  Renderer2,
  ViewChild,
  EventEmitter,
  Output,
  OnDestroy,
} from '@angular/core';
import { VdsLibService } from '../vds-lib.service';
import { SLIDER_DEFAULT } from './slider.constants';
import { coerceNumberProperty } from '@angular/cdk/coercion';

@Component({
  selector: 'vds-slider',
  templateUrl: './slider.component.html',
})
export class SliderComponent implements OnInit, OnDestroy {
  /**
   * The label on the slider (Defaults to 'Slider control')
   */
  @Input() label: string;
  /**
   * The maximum value of the slider (Defaults to 100).
   */
  @Input() max: number;
  /**
   * The minimum value of the slider (Defaults to 0).
   */
  @Input() min: number;
  /**
   * The starting value of the slider (Defaults to min).
   */
  @Input() value: number;
  /**
   * Emits slider value on drag.
   */
  @Output() change: EventEmitter<any> = new EventEmitter();

  focused = false;
  nodeValue: number;
  range: number;
  trackValue: number;
  trackWidth: number;
  trackX: number;
  moveListener: () => void;
  upListener: () => void;

  @ViewChild('track') track: any;

  constructor(
    private renderer: Renderer2,
    private vdsLibService: VdsLibService
  ) {}

  private checkEndpointLogic() {
    if (this.min < 0) {
      this.min = 0;
    }
    if (this.min > this.max) {
      this.max = this.min + 1;
    }
    this.range = this.max - this.min;
  }

  private position(event: MouseEvent | number) {
    switch (typeof event) {
      case 'number':
        if (event > this.max) {
          event = this.max;
          this.value = event;
        }
        if (event < this.min) {
          event = this.min;
          this.value = event;
        }
        const percentage = (event - this.min) / this.range;
        this.trackValue = percentage * this.trackWidth;
        this.nodeValue =
          this.trackValue - SLIDER_DEFAULT.NODE.MIDPOINT;
        break;
      default:
        this.trackValue = event.x - this.trackX;
        this.nodeValue =
          this.trackValue - SLIDER_DEFAULT.NODE.MIDPOINT;
    }
    if (this.trackValue <= -1) {
      this.trackValue = 0;
      this.nodeValue = 0 - SLIDER_DEFAULT.NODE.MIDPOINT;
      return;
    }
    if (this.trackValue >= this.trackWidth + 1) {
      this.trackValue = this.trackWidth;
      this.nodeValue =
        this.trackWidth - SLIDER_DEFAULT.NODE.MIDPOINT;
      return;
    }
    this.value =
      typeof event === 'number'
        ? this.value
        : Math.round(
            (this.trackValue / this.trackWidth) *
              (this.max - this.min) +
              this.min
          );
    if (this.value > this.max) {
      this.value = this.max;
    }
    if (this.value < this.min) {
      this.value = this.min;
    }
    this.change.emit(this.value);
  }

  private clearListeners() {
    if (this.upListener) {
      this.upListener();
      delete this.upListener;
    }
    if (this.moveListener) {
      this.moveListener();
      delete this.moveListener;
    }
  }

  ngOnInit() {
    this.max = this.max
      ? coerceNumberProperty(this.max)
      : 100;
    this.min = this.max
      ? coerceNumberProperty(this.min)
      : 0;
    this.label = 'Slider control';
    this.value = this.value
      ? coerceNumberProperty(this.value)
      : null;
    this.checkEndpointLogic();
    const coords = this.vdsLibService.getBoundingBoxAndCoords(
      this.track.nativeElement
    );
    this.trackX = coords.left;
    this.trackWidth = coords.width;
    if (this.value) {
      this.position(this.value);
    }
  }

  ngOnDestroy() {
    this.clearListeners();
  }

  onMousedown(): void {
    this.moveListener = this.renderer.listen(
      'document',
      'mousemove',
      (event: MouseEvent) => {
        this.position(event);
      }
    );
    this.upListener = this.renderer.listen(
      'document',
      'mouseup',
      (event: MouseEvent) => {
        this.onMouseup();
      }
    );
  }

  onMouseup(): void {
    this.clearListeners();
    this.focused = false;
  }

  onFocus(): void {
    this.focused = true;
  }

  onBlur(): void {
    this.focused = false;
  }
}

