  @ViewChild('tooltipReference') tooltipRef: ElementRef;
  @ViewChild('tooltipText') tooltipText: ElementRef;
  @ViewChild('step') step: HTMLElement;

  STEPID = '';
  isShowing = false;
  isActive = false;
  isCompleted = false;
  hasError = false;
  errorSymbol = STEP.DEFAULT.ERROR;
  next: StepComponent | null = null;
  prev: StepComponent | null = null;
  number = '';
  stepSpatialProperties: any = {};
  tooltipSpatialProperties: any = {};

  @HostListener('window:resize', [])
  onResize() {
    this.getTooltipProperties();
    this.getStepProperties();
    if (this.tooltipRef) {
      this.tooltipRef.nativeElement.style.left =
        this.stepSpatialProperties.left +
        this.stepSpatialProperties.width / 2 -
        this.tooltipSpatialProperties.width / 2 +
        STEP.DEFAULT.UNITS;
    }
