  ngOnInit() {}

  private getStepProperties() {
    this.stepSpatialProperties = this.vdsLibService.getBoundingBoxAndCoords(
      this.el.nativeElement
    );
  }

  private getTooltipProperties() {
    if (this.tooltipRef) {
      this.tooltipSpatialProperties = this.vdsLibService.getBoundingBoxAndCoords(
        this.tooltipRef.nativeElement,
        true
      );
    }
  }

  private setTooltipPosition() {
    if (this.tooltipRef) {
      this.tooltipRef.nativeElement.style.top =
        this.tooltipSpatialProperties.top -
        STEP.DEFAULT.PADDING +
        STEP.DEFAULT.UNITS;
      this.tooltipRef.nativeElement.style.left =
        this.stepSpatialProperties.left +
        this.stepSpatialProperties.width / 2 -
        this.tooltipSpatialProperties.width / 2 +
        STEP.DEFAULT.UNITS;
    }
  }

  ngAfterViewInit() {
    this.getStepProperties();
    this.getTooltipProperties();
    this.setTooltipPosition();
  }
  show() {
    this.isShowing = true;
  }

  hide() {
    this.isShowing = false;
  }

  activate() {
    this.isActive = true;
  }

  deactivate() {
    this.isActive = false;
    this.hasError = false;
    this.isCompleted = false;
  }

  complete(success?: boolean) {
    this.isActive = false;
    this.isCompleted = success;
    this.hasError = !success;
  }
}

