  /**
   * Set as read-only statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() readOnly: boolean;
  /**
   * Set as required statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() required: boolean;
  /**
   * Toggle check mark usage statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() showCheckMark: boolean;
  /**
   * The native type of the element.
   */
  @Input() type: string;
  /**
   * Apply validation logic through props.
   */
  @Input() validate: boolean;
  /**
   * The value of the element.
   */
  @Input() value: string;
  /**
   * Emits changed value.
   */
  @Output() change = new EventEmitter<any>();
  /**
   * Emits error object.
   */
  @Output() error = new EventEmitter<any>();

  @Input() formUse: boolean;

  @ViewChild('theInput') input: ElementRef;

  public focused = false;
  public preFilledContent: boolean;
  public remainingCount = 0;
  public textFieldID: string;
  public textFieldName: string;
  public textFieldMessage: string;

  private initialValue: string;
  private inputEl: any;
  private tighterTextArea = 10;

  constructor(
    private vdsLibService: VdsLibService,
    private cdRef: ChangeDetectorRef
  ) {
    super();
  }

  ngOnInit() {
    this.initialValue = this.value ? this.value : null;
    this.preFilledContent = !!this.initialValue;
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(TEXT_FIELD.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + TEXT_FIELD.SUFFIX.NAME;
    this.autoGrow = this.vdsLibService.triageDisabledValue(
      this.autoGrow
    );
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
    this.multiline = this.vdsLibService.triageDisabledValue(
      this.multiline
    );
    this.required = this.vdsLibService.triageDisabledValue(
      this.required
    );
    this.validate = this.vdsLibService.triageDisabledValue(
      this.validate
    );
    this.readOnly = this.vdsLibService.triageDisabledValue(
      this.readOnly
    );
    this.showCheckMark = this.vdsLibService.triageDisabledValue(
      this.showCheckMark
    );
    this.formUse = this.vdsLibService.triageDisabledValue(
      this.formUse
    );
    this.textFieldID = `${this.id}${
      TEXT_FIELD.SUFFIX.NATIVE
    }`;
    this.textFieldName = `${this.name}${
      TEXT_FIELD.SUFFIX.NATIVE
    }`;
    this.textFieldMessage = `${this.id}${
      TEXT_FIELD.SUFFIX.MESSAGE
    }`;
    if (
      this.characterCounter &&
      this.characterCounter.limit
    ) {
      this.remainingCount = this.characterCounter.limit;
      this.characterCounter.remainder = this.remainingCount;
      this.cdRef.detectChanges();
    }
    this.writeValue(this.value);
    this.change.emit(this.value);
  }

  ngAfterViewInit() {
    this.inputEl = this.input.nativeElement;
    if (this.autoGrow) {
      setTimeout(() => {
        this.resizeTextarea();
      }, 1);
    }
  }

  onFocus(event?: Event): void {
    if (this.readOnly || this.disabled) {
      return;
    }
    this.focused = true;
  }

  onBlur(el): void {
    if (this.readOnly || this.disabled) {
      return;
    }
    this.focused = false;
    if (el.invalid) {
      this.error.emit(el.errors);
    }
    if (
      this.preFilledContent &&
      this.initialValue &&
      this.value !== this.initialValue
    ) {
      this.preFilledContent = false;
    }
    this.writeValue(this.value);
    this.change.emit(this.value);
  }

  onTyping(el) {
    if (el.invalid) {
      this.error.emit(el.errors);
    }
    this.writeValue(this.value);
    this.change.emit(this.value);
    if (this.characterCounter) {
      const currentLength: number = this.inputEl.value
        .length;
      this.remainingCount =
        this.characterCounter.limit - currentLength;
      this.characterCounter.remainder = this.remainingCount;
      this.cdRef.detectChanges();
    }
    if (this.autoGrow) {
      setTimeout(() => {
        this.resizeTextarea();
      }, 1);
    }
  }

  writeValue(value: any) {
    super.writeValue(value);
    this.value = value;
    this.cdRef.detectChanges();
    this.change.emit(this.value);
  }

  reset() {
    this.value = this.initialValue;
    this.writeValue(this.value);
    this.change.emit(this.value);
  }

  clear() {
    this.value = null;
    this.writeValue(this.value);
    this.change.emit(this.value);
  }

  resizeTextarea(): void {
    if (window) {
      this.inputEl.style.height = 'inherit';
      this.inputEl.style.height =
        this.inputEl.scrollHeight -
        this.tighterTextArea +
        'px';
    }
  }
}

