import { ToggleButtonComponent } from '../toggle-button.component';
import { VdsLibService } from '../../vds-lib.service';

@Component({
  selector: 'vds-toggle-button-set',
  templateUrl: './toggle-button-set.component.html',
})
export class ToggleButtonSetComponent
  implements OnInit, AfterContentInit {
  /**
   * The legend label for a group of toggle buttons.
   */
  @Input() get label(): string {
    return this._label;
  }
  set label(value: string) {
    this._label = value;
  }
  _label: string;
  /**
   * Shared name for a group of toggle buttons.
   */
  @Input() get name(): string {
    return this._name;
  }
  set name(value: string) {
    this._name = value;
  }
  _name: string;
  /**
   * Emits the child toggle button's value property when selected.
   */
  @Output() select: EventEmitter<
    string
  > = new EventEmitter();

  @ContentChildren(ToggleButtonComponent)
  buttons: QueryList<ToggleButtonComponent>;

  _buttons: Array<ToggleButtonComponent> = [];
  selectedToggleButton: ToggleButtonComponent;
  focusedToggleButton: ToggleButtonComponent;

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.label = this.label
      ? this.label
      : TOGGLEBUTTON.DEFAULT.LABEL;
    this.name = this.name
      ? this.name
      : `${
          TOGGLEBUTTON.DEFAULT.NAME_PREFIX
        }${this.vdsLibService.getUUID()}`;
  }

  ngAfterContentInit() {
    this._buttons = this.buttons.toArray();
    this._buttons.forEach(
      (button: ToggleButtonComponent) => {
        if (this.selectedToggleButton && button.checked) {
          button.checked = false;
          console.warn(
            '[VDS NG] Toggle-Button has multiple preselected values. Defaults to first value.'
          );
        }
        if (button.checked) {
          this.selectedToggleButton = button;
          this.select.emit(this.selectedToggleButton.value);
        }
      }
    );
  }

  onBlur() {
    if (this.focusedToggleButton) {
      this.focusedToggleButton.focused = false;
      this.focusedToggleButton = null;
    }
  }

  onFocus(button: ToggleButtonComponent) {
    if (this.focusedToggleButton) {
      this.focusedToggleButton.focused = false;
    }
    this.focusedToggleButton = button;
    this.focusedToggleButton.focused = true;
  }

  selectButton(
    button: ToggleButtonComponent,
    event: MouseEvent
  ) {
    if (event.pageX) {
      this.focusedToggleButton.focused = false;
      this.focusedToggleButton = null;
    }
    if (this.selectedToggleButton) {
      this.selectedToggleButton.checked = false;
    }
    this.selectedToggleButton = button;
    this.selectedToggleButton.checked = true;
    this.select.emit(this.selectedToggleButton.value);
  }
}

import {
  Component,
  OnInit,
  Input,
  AfterViewInit,
  ViewChild,
  ElementRef,
  Renderer2,
  OnDestroy,
} from '@angular/core';
import { VdsLibService } from '../vds-lib.service';
import { TOOLTIP } from './tooltip.constant';

@Component({
  selector: 'vds-tooltip',
  templateUrl: './tooltip.component.html',
})
export class TooltipComponent
  implements OnInit, AfterViewInit, OnDestroy {
  constructor(
    private vdsLibService: VdsLibService,
    private renderer: Renderer2,
    private element: ElementRef
  ) {}

  /**
   * The id of the element.
   */
  @Input() id: string;
  /**
   * Optional parent element
   */
  @Input() public parentEl: ElementRef;
  /**
   * Either a string that expresses text displayed in the tooltip or
   * an object that expresses tooltip configurations
   */
  @Input() tooltipOptions: any;

  @ViewChild('vdsTooltip') tootipContent: any;

  public tooltipID: string;
  private positionTimer: number;

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(TOOLTIP.PREFIX.ID);
    this.tooltipID = `${this.id}${TOOLTIP.SUFFIX.NATIVE}`;
  }

  position() {
    let positionConfig: string = this.tooltipOptions
      .position;

    // this is safe only because tooltips will never be triggered on the server-side
    // if rendering with Universal
    const viewportWidth = window.innerWidth;

    const scrollX = window.pageXOffset;
    const scrollY = window.pageYOffset;

    const tooltipBBox = this.vdsLibService.getBoundingBoxAndCoords(
      this.tootipContent.nativeElement,
      true
    );
    const tooltipHeight = tooltipBBox.height;
    const tooltipWidth = tooltipBBox.width;

    const triggerBBox = this.vdsLibService.getBoundingBoxAndCoords(
      this.parentEl.nativeElement,
      true
    );
    const triggerHeight = triggerBBox.height;
    const triggerWidth = triggerBBox.width;
    const triggerY = triggerBBox.top;
    const triggerX = triggerBBox.left;

    const fitIfTop = triggerY - tooltipHeight;
    const fitIfBottom =
      triggerY + triggerHeight + tooltipHeight;
    const fitIfRight =
      triggerX + triggerWidth + tooltipWidth;

    let top = 0;
    let left = 0;

    if (
      positionConfig.toLowerCase() === TOOLTIP.POSITION.AUTO
    ) {
      // if we can go upward
      if (fitIfTop > 0) {
        positionConfig = TOOLTIP.POSITION.TOP;
      } else {
        // if we can go to the right
        if (fitIfRight < viewportWidth) {
          positionConfig = TOOLTIP.POSITION.RIGHT;
        } else {
          // if we can go downward
          if (fitIfBottom) {
            positionConfig = TOOLTIP.POSITION.BOTTOM;
          } else {
            // if we can go left
            positionConfig = TOOLTIP.POSITION.LEFT;
          }
        }
      }
    }

    // a margin between the trigger and tooltip
    const margin = 2;

    switch (positionConfig) {
      case TOOLTIP.POSITION.TOP:
        top = triggerY - tooltipHeight - margin;
        left =
          triggerX + triggerWidth / 2 - tooltipWidth / 2;
        break;
      case TOOLTIP.POSITION.RIGHT:
        top =
          triggerY + triggerHeight / 2 - tooltipHeight / 2;
        left = triggerX + triggerWidth + margin;
        break;
      case TOOLTIP.POSITION.BOTTOM:
        top = triggerY + triggerHeight + margin;
        left =
          triggerX + triggerWidth / 2 - tooltipWidth / 2;
        break;
      case TOOLTIP.POSITION.LEFT:
        top =
          triggerY + triggerHeight / 2 - tooltipHeight / 2;
        left = triggerX - tooltipWidth - margin;
        break;
    }

    top += scrollY;
    left += scrollX;

    this.renderer.removeClass(
      this.element.nativeElement,
      TOOLTIP.POSITION.TOP
    );
    this.renderer.removeClass(
      this.element.nativeElement,
      TOOLTIP.POSITION.RIGHT
    );
    this.renderer.removeClass(
      this.element.nativeElement,
      TOOLTIP.POSITION.BOTTOM
    );
    this.renderer.removeClass(
      this.element.nativeElement,
      TOOLTIP.POSITION.LEFT
    );
    this.renderer.addClass(
      this.element.nativeElement,
      positionConfig
    );
    if (this.element) {
      this.renderer.setStyle(
        this.tootipContent.nativeElement,
        TOOLTIP.POSITION.TOP,
        top + TOOLTIP.CSS.PX
      );
      this.renderer.setStyle(
        this.tootipContent.nativeElement,
        TOOLTIP.POSITION.LEFT,
        left + TOOLTIP.CSS.PX
      );
      this.renderer.setStyle(
        this.tootipContent.nativeElement,
        TOOLTIP.CSS.DISPLAY,
        TOOLTIP.CSS.BLOCK
      );
      this.renderer.setStyle(
        this.tootipContent.nativeElement,
        TOOLTIP.CSS.ZINDEX,
        '1000'
      );
      this.tootipContent.nativeElement.dataset.align = positionConfig;
    }
  }

  ngAfterViewInit() {
    if (window) {
      if (this.positionTimer) {
        window.clearTimeout(this.positionTimer);
      }
      this.positionTimer = window.setTimeout(() => {
        this.position();
      }, 1);
    }
  }

  ngOnDestroy(): void {
    if (window) {
      if (this.positionTimer) {
        window.clearTimeout(this.positionTimer);
      }
    }
  }
}

import {
  Component,
  OnInit,
  ContentChildren,
  AfterContentInit,
  AfterViewInit,
  Output,
  EventEmitter,
  SimpleChanges,
  OnChanges,
  QueryList,
} from '@angular/core';
import { StepComponent } from './step/step.component';

@Component({
  selector: 'vds-wizard',
  templateUrl: './wizard.component.html',
})
export class WizardComponent
  implements OnInit, AfterContentInit {
  @ContentChildren(StepComponent) steps: QueryList<
    StepComponent
  >;

  endStep: StepComponent;
  currentStep: StepComponent;
  leftPosition: number;
  stepsArray: Array<StepComponent>;

  /**
   * Emits zero-based step indices.
   */
  @Output() change: EventEmitter<any> = new EventEmitter();

  constructor() {}

  ngOnInit() {}

  private setRefs() {
    this.stepsArray = this.steps.toArray();
    let stepNumber: number;
    for (let i = 0; i < this.stepsArray.length; i++) {
      this.stepsArray[i].number = (i + 1).toString();
      stepNumber = parseInt(this.stepsArray[i].number, 10);
      this.stepsArray[i].prev =
        stepNumber === 1 ? null : this.stepsArray[i - 1];
      this.stepsArray[i].next =
        stepNumber === this.stepsArray.length
          ? this.endStep
          : this.stepsArray[i + 1];
    }
    if (this.stepsArray.length) {
      this.stepsArray.push(this.endStep);
      this.currentStep = this.stepsArray[0];
      this.currentStep.activate();
      this.change.emit(this.getCurrentStep());
    }
  }

  ngAfterContentInit() {
    this.initializeSteps();
    // support asynchronously loaded steps
    this.steps.changes.subscribe(() => {
      this.initializeSteps();
    });
  }

  private initializeSteps() {
    setTimeout(() => {
      if (this.steps) {
        this.setRefs();
      }
    });
  }

  /**
   * Moves wizard progress forward one step if possible.
   * @param success When true, shows positive progress. When false, shows error.
   */
  public next(success?: boolean) {
    if (this.currentStep.next) {
      this.currentStep.complete(success);
      this.currentStep.next.activate();
      this.currentStep = this.currentStep.next;
      this.change.emit(this.getCurrentStep());
      return;
    }
    this.currentStep.complete(success);
    this.change.emit(this.getCurrentStep() + 1);
  }

  /**
   * Moves wizard progress back one step if possible.
   */
  back() {
    if (this.currentStep.prev) {
      if (
        parseInt(this.currentStep.number, 10) ===
          this.steps.length &&
        (this.currentStep.isCompleted ||
          this.currentStep.hasError)
      ) {
        this.currentStep.isCompleted = false;
        this.currentStep.hasError = false;
        this.currentStep.activate();
        this.change.emit(this.getCurrentStep());
        return;
      }
      this.currentStep.deactivate();
      this.currentStep.prev.activate();
      this.currentStep = this.currentStep.prev;
      this.change.emit(this.getCurrentStep());
    }
  }

  /**
   * Sets all steps to a default value.
   */
  reset() {
    const stepsArray = this.steps.toArray();
    for (let i = 0; i < this.stepsArray.length - 1; i++) {
      stepsArray[i].deactivate();
      stepsArray[i].hasError = false;
      stepsArray[i].isCompleted = false;
    }
    this.currentStep = stepsArray[0];
    this.currentStep.activate();
  }

  /**
   * Returns current step index.
   */
  getCurrentStep(): number {
    return parseInt(this.currentStep.number, 10) - 1;
  }

  /**
   * Sets specified number of steps with given array of
   * states (true = complete, false = invalid). When given
   * an array larger than the steps, the given array is truncated.
   * @param arr An array representing the wizard state.
   */
  setSteps(arr: Array<boolean>) {
    this.reset();
    while (arr.length > this.stepsArray.length) {
      arr.pop();
    }
    for (let i = 0; i < arr.length; i++) {
      this.stepsArray[i].complete(arr[i]);
    }
    this.currentStep = this.stepsArray[arr.length];
    if (this.currentStep === undefined) {
      this.currentStep = this.stepsArray[arr.length - 1];
    }
  }

  /**
   * Returns steps.
   * @param type The type of steps returned.
   * To get all completed, pass 'true'; To get all invalid, pass 'false'.
   * To get all steps, call with no arguments.
   */
  getSteps(type?: boolean): Array<StepComponent> {
    switch (type) {
      case true:
        return this.stepsArray.filter(
          (step) => step.isCompleted
        );
      case false:
        return this.stepsArray.filter(
          (step) => step.hasError
        );
      default:
        return this.stepsArray;
    }
  }
}

