projects/vds-lib/src/lib/datatable/datat.defaultValue:
(column: any) => {
  const isColumnFiltered = column.hasOwnProperty(
    'isColumnFiltered'
  )
    ? !!column.isColumnFiltered
    : false;
  const isSortable = column.hasOwnProperty('isSortable')
    ? !!column.isSortable
    : false;

  if (!column.hasOwnProperty('id')) {
    throw new Error(
      'Every column object must have an `id` property containing a unique string'
    );
  }

  let sortFn = null;
  if (typeof column.sortFn === 'function') {
    let retValue = column.sortFn(1, 2);
    if (retValue !== undefined && retValue !== null) {
      retValue = Number(retValue);
      if (
        retValue === 0 ||
        retValue === 1 ||
        retValue === -1
      ) {
        sortFn = column.sortFn;
      }
    }
  }

  return {
    id: column.id.toString(),
    value:
      column.value !== undefined && column.value !== null
        ? column.value
        : '',
    type: (column.type || '').toString().trim(),
    header:
      column.header !== undefined && column.header !== null
        ? column.header
        : '',
    tooltipValue:
      column.tooltipValue !== undefined &&
      column.tooltipValue !== null
        ? column.tooltipValue
        : '',
    sortFn,
    isColumnFiltered,
    isSortable,
  };
}

